INSERT INTO `smart_resolutionnote` (`id`, `ticket_id`, `rsltn_type`, `rsltn_status`, `rsltn_date`, `rsltn_byuser`, `rsltn_servicedate`, `rsltn_servicennumber`, `rsltn_counter`, `rsltn_eta`, `rsltn_etd`, `rsltn_inspection`, `rsltn_actiontaken`, `rsltn_actionmethod`, `rsltn_planning`, `rsltn_remark`, `datemodified`) VALUES
(1, 87, 'SN', 0, '2010-01-30 11:26:48', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Rosdi back to office today to take the jarfalla. Loan jarfalla with S/N:4130135. "', '', ' ', '', NULL),
(2, 87, 'SN', 0, '2010-01-29 15:48:50', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Schedule for PM 31 already change due to ICAO installation. There is no central engineer assign to do PM at site. Rosdi as regional engineer at sabah is assign to do PM there. After discussion with En Fauzi, there is a risk if sending Jarfalla to the site. So suggest to ask Rosdi to back to KL this weekend to take jarfalla. So call Rosdi and he will back to KL this weekend."', '', ' ', '', NULL),
(3, 93, 'SN', 0, '2010-01-29 15:01:31', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Arham. He informed that due the chnages of ICAO installation schedule, he will not back to KL this week. Since have 2 jarfalla at site, so agree with him to pass the jarfalla to the pM team."', '', ' ', '', NULL),
(4, 86, 'SN', 0, '2010-01-29 15:25:27', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call ADUKOM. Log close with Irwan."', '', ' ', '', NULL),
(5, 86, 'SN', 0, '2010-01-29 15:21:19', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Mdm Chan mobile since keep calling direct line but nobody pickup. Confirmed with madam chan no problem occur anymore. Allow us to close log."', '', ' ', '', NULL),
(6, 89, 'SN', 0, '2010-01-29 13:51:24', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Maria ask Ashok to check on site and ashok already check pc problem. Actually the problem happened just in the morning. Until now, no problem occur anymore. But Maria suggest to sent loan unit at side. Ashok have the loan unit with him but the unit need to be setup first. Will check status with maria nextweek since start from Yesterday, she on leave."', '', ' ', '', NULL),
(7, 86, 'SN', 0, '2010-01-29 11:25:37', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user many times but line keep busy. Will call back later yto update status."', '', ' ', '', NULL),
(8, 80, 'CM', 0, '2010-01-29 09:46:29', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-24 11:15:00', '2010-01-24 12:41:00', '', '"Received CM report from Anuar. Problem Check film. Supporting tube spindal damaged.\nAction taken:\n1. Supporting tube spindal replaced.\n2. Did test print.\n3. Production monitored.\nCM success. Printer in good condition. Production continue as usual."', '', ' ', '', NULL),
(9, 23, 'CM', 0, '2010-01-28 09:35:48', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-25 11:00:00', '2010-01-25 16:00:00', '', '"Received CM report from Sufian. Problem monitor display blur. He change with ne monitor.\nNew : V1WG011."', '', ' ', '', NULL),
(10, 76, 'CM', 0, '2010-01-28 09:28:54', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-22 15:00:00', '2010-01-22 16:00:00', '', '"Received CM report from Sufian. Problem white dot on printed data page and white line on printed data page.\nAction taken:\n1. General cleaning.\n2. Teach new IO how to cleaning.\n3. Test print and monitor production.\nProduction continue as usual."', '', ' ', '', NULL),
(11, 78, 'CM', 0, '2010-01-28 09:11:48', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-25 11:00:00', '2010-01-25 16:00:00', '', '"Received CM report from Sufian. Problem check camera unit. Book stuck at PI unit.\nAction taken:\n1. Check sensor measurement.\n2. General cleaning.\n3. Open and general cleaning CCD.\n4. Test print and feed test.\n5. Monitor production.\nPrinter work as usual."', '', ' ', '', NULL),
(12, 95, 'CM', 0, '2010-01-28 09:07:22', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-26 11:00:00', '2010-01-26 13:00:00', '', '"Received CM report from Sufian on site on 26/01/10 (Tue) around 11:00am. Problem found dislocation and vertical line.\nAction taken:\n1. Measure and adjust tension belt 1 for platen roller. Before: 106Hz. After: 402Hz.\n2. Test print and monitor production.\nProduction continue as usual.\nLog close since this problem resolved by sufian on site and approved by PIT Low Wei Hian."', '', ' ', '', NULL),
(13, 81, 'CM', 0, '2010-01-28 09:00:42', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-26 11:00:00', '2010-01-26 13:00:00', '', '"Received CM report from Sufian. Problem book stuck between feeder and CCD and error PF1 SP JAM. \nAction taken:\n1. Allignment.\n2. Teach user ho to do allignment.\n3. Feed test for 32 pages and 64 pages passport.\n4. Monitor production.\nProduction continue as usual."', '', ' ', '', NULL),
(14, 94, 'CM', 0, '2010-01-27 13:41:56', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-26 10:15:00', '2010-01-26 17:00:00', '', '"Received CM report from Arham via fax. On site on 26/01/10 (Tues) around 10:15am. Problem that horizontal line on data page. He found that heat roller need to be changed due to reach its lifespan. \nAction taken:\n1. Change heat roller with new one.\n2. Try to clean thermal head - problem remain.\n3. Change ID6 from 9 to 10, ID22 from 20 to 12 and also ID20 from -7 to -3.\nProblem solved. Productions continue as usual. Log close since this problem alreday resolved by Arham on site and approved by PIT Noor Afzan."', '', ' ', '', NULL),
(15, 88, 'CM', 0, '2010-01-28 18:53:07', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-27 08:45:00', '2010-01-27 09:50:00', '', '"Received CM report from Naufal. Problem found FILM ENCODER S ERROR. Broken supporting tube spindle tooth found in film supply support. \nAction taken:\n1. Broken spindle tooth removed.\n2. Test print performed.\n3. Production monitored.\nPrinter in good condition."', '', ' ', '', NULL),
(16, 86, 'CM', 0, '2010-01-28 18:49:41', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-28 15:20:00', '2010-01-28 16:45:00', '', '"Received CM report from Sufian and Azzeri. They already replace the faulty printer with loan printer. Production continue as usual with loan unit. \nfaulty : 03B7201\nLoan : 03H4402"', '', ' ', '', NULL),
(17, 86, 'CM', 0, '2010-01-28 18:44:43', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-27 09:00:00', '2010-01-27 11:00:00', '', '"Received CM report from naufal and Yusuf. Problem found remove sheet in the printer and printer unable to ready. \nAction taken:\n1. Electrical and mechanical control boards replace for testing but still not ok. "', '', 'Need to replace printer with loan printer and bring back the faulty printer to office to investigate the problem.', '', NULL),
(18, 86, 'SN', 0, '2010-01-28 17:11:42', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Sufian. Already replaced faulty E2000 with loan unit. Test 3 production since already late and not many production to process. For 3 passport and test print, printer work well. Status resolved. Will see the performance of printer tomorrow and will update status of printer with user first tomorrow before log can be close."', '', ' ', '', NULL),
(19, 85, 'SN', 0, '2010-01-28 14:10:38', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Kak Shima. She informed that she already install the roller inside the printer and no line appear anymore. Ask her to keep the faulty roller and give to our engineer when they attend site for next PM. Kak Shima also mentioned that today is the last day she will b ein process room. She will be transfer to other department. But she will remind the IO about the roller. Log able to close."', '', ' ', '', NULL),
(20, 85, 'SN', 0, '2010-01-28 11:44:04', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Kak Shima. She informed that he just received parts. She will try first and will call back later."', '', ' ', '', NULL),
(21, 86, 'SN', 0, '2010-01-28 10:05:51', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Since Yusuf in charge in new installation of E2000 at WWNG yesterday and today, need to assign other engineer to send loan unit of E2000 at site. Assign Sufian to sent the unit to site since he standby at office this week. Assist by Azzeri."', '', ' ', '', NULL),
(22, 93, 'SN', 0, '2010-01-27 15:15:18', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Arham. He informed that jarfalla print dirty. When he check, he found that there is some scratch at the printer head. He suspect that the scratch cause the jarfalla to print dirty. Since at site still have 2 jarfalla that can be use, so ask whether we can replace jarfalla at site nextweek because arham will be back to KL nextweek for ICAO implementation at BPKL and when he back to KL on monday, we can pass jarfalla loan unit to him. Agree and noted."', '', ' ', '', NULL),
(23, 92, 'SN', 0, '2010-01-28 11:17:55', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Arham.Ask him the status of printer. He informed that after he fold the page a bit thick problem resolved. Log able to close for this moment."', '', ' ', '', NULL),
(24, 92, 'SN', 0, '2010-01-27 15:15:05', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Arham. Report that jarfalla at site unable to feed when it cannot print cetakan pemerhatian at page 31 because it too thin. Ask Arham to fold the page until its become more thick so that jarfalla can feed paper and print. Arham will try first."', '', ' ', '', NULL),
(25, 90, 'SN', 0, '2010-01-28 09:34:41', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with kak izah. She informed that only 3 passport produce today. She ask to update status in the afternoon."', '', ' ', '', NULL),
(26, 90, 'SN', 0, '2010-01-27 17:44:25', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received email from Faizal. He already remote site and setting the OCR cropping\nHeight Pos From Bottom= 990\nCrop Pixels From Bottom = 860\nCrop Pixels From Left = 975\nCrop Pixels From Right = 35\nCrop Width = 350\n"', '', ' ', '', NULL),
(27, 84, 'SN', 0, '2010-01-28 09:26:09', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Pn Zaidah. She informed that Pn Faridah already received the cleaning kits yesterday. Log close."', '', ' ', '', NULL),
(28, 84, 'SN', 0, '2010-01-28 09:24:10', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call User spoke with Pn Zaidah. She informed that she not get the cleaning kits yet. Inform her that cleaning kits sent attn to Pn. faridah Johan. She will ask Pn Faridah first and will informed us back later."', '', ' ', '', NULL),
(29, 86, 'SN', 0, '2010-01-27 14:00:22', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Yusuf back to office from site. He informed that problem not resolved yet. When he want to try test print, suddently printer off. He found that one of the board faulty. Hesuggest to sent loan unit first at site since to repair the board take time. He will sent the loan unit to the site tomorrow since Innova sent to repair. he will go to the site to informed user about this."', '', ' ', '', NULL),
(30, 88, 'SN', 0, '2010-01-27 13:12:39', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Spoke with Syukri. He informed that alot of passport printed without problem after Naufal repair. Allow us to close log."', '', ' ', '', NULL),
(31, 91, 'SN', 0, '2010-01-27 10:01:04', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Dynadi. Spoke with Gan. Informed her the problem and ask her to sent new access card to the site. She agree and noted."', '', ' ', '', NULL),
(32, 91, 'SN', 0, '2010-01-27 08:51:45', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from En razi. Update the status. Informed him about the access card and he ask me to informed dynadi to give new access card to the site aroung 5 or 6 cards. "', '', ' ', '', NULL),
(33, 91, 'SN', 0, '2010-01-27 08:34:57', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Confirmed status with Pn Ismahan. She informed that before thsi door  lock again and after they try many time, can open. And they decide to not close the door. She also informed that 2 of their access card broken. Need a new replacement."', '', ' ', '', NULL),
(34, 91, 'SN', 0, '2010-01-27 08:12:06', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received sms from PN Ismahan. She informed that access door alraedy can open."', '', ' ', '', NULL),
(35, 91, 'SN', 0, '2010-01-27 08:02:21', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call PIT Ismahan. She informed that access door cannot be open. Ask user to cut the wire but they not found any wire. Will check first and will call user back."', '', ' ', '', NULL),
(36, 91, 'SN', 0, '2010-01-27 08:00:37', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from En razi. he informed that user cannot enter process room. He ask to follow up with user."', '', ' ', '', NULL),
(37, 86, 'SN', 0, '2010-01-27 11:33:39', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Yusuf. Need to prepare mechanical board and LCD for him to be use at site. He will be baxk to office to take it."', '', ' ', '', NULL),
(38, 86, 'SN', 0, '2010-01-27 10:35:43', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Naufal received call from Yusuf request for electrical board. Naufal will send the board to Yusuf on site."', '', ' ', '', NULL),
(39, 85, 'SN', 0, '2010-01-27 11:13:39', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Prepare roller to be send to site via nationwide."', '', ' ', '', NULL),
(40, 82, 'SN', 0, '2010-01-27 11:11:29', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. First time call not pickup. 2nd time call answer by En Zul. Because of his holiday on Monday and not so sure about the problems that occurred, I just asked about the situation on this computer. and he is sure there is no problem to happen on this computer. He gave permission to close the log and will report back if the problem recurring."', '', ' ', '', NULL),
(41, 90, 'SN', 0, '2010-01-27 10:59:10', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Informed problem to Software team via email."', '', ' ', '', NULL),
(42, 90, 'SN', 0, '2010-01-27 09:30:25', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with PN Izah regarding the problem in log 1001-89(L). She also report this problem happened since yesterday. Yesterday a lot of popup window appear and one printed wrong. 21123488 -> 21123486. For this morning all 5 passport appear popup window. I will informed thsi problem to system analyst. "', '', ' ', '', NULL),
(43, 89, 'SN', 0, '2010-01-27 09:30:00', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Informed problem to Maria. She will check the setting for Imbasan PC and will informed the status later."', '', ' ', '', NULL),
(44, 89, 'SN', 0, '2010-01-27 09:04:48', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Spoke with Pn Izah. She informed that now PC can be use but autoshutdown happened while doing process. Sometime after loading window and sometime while doing imbasan. Will check with system analyst first and will informed back user. User informed that they already report the problem to Ashok. Ashok promise with them to be on site today."', '', ' ', '', NULL),
(45, 88, 'SN', 0, '2010-01-27 09:36:14', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received sms from Naufal. Problem: FILM ENCODERS ERROR. Broken film spindle tooth found in film supply cause the problem. Problem resolved. Production continue."', '', ' ', '', NULL),
(46, 88, 'SN', 0, '2010-01-27 08:26:15', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Naufal. He on his way to office but not arrive yet. Ask him to go look on site. He will."', '', ' ', '', NULL),
(47, 88, 'SN', 0, '2010-01-27 08:24:34', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Yusuf to confirm what time they will do PM today since this morning Yusuf have to do PM at WPIN first. Yusuf informed that they will do PM at site after office our together with new installation of new printer added at site. Noted."', '', ' ', '', NULL),
(48, 88, 'SN', 0, '2010-01-27 08:21:16', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from julida. She informed that film stick at the platen roller. User already remove it but it is difficult to remove it. Informed user that our PM team will be on site today to do PM but in the evening. User ask to sent engineer at the morning since just one printer can be use and a lot of production to monitor."', '', ' ', '', NULL),
(49, 87, 'SN', 0, '2010-01-26 16:17:12', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call process room speak with Mr. Ng. Guide him to do test print but failed since jarfalla still cannot feed paper. It pull the papera nd push it back. Informed user to use another jarfalla since that jarfalla can be use for both process. I will pass loan unit jarfalla to PM team to be replace at site on 8 february 2010. User agree."', '', ' ', '', NULL),
(50, 87, 'SN', 0, '2010-01-26 16:13:39', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Mr. Ng. He informed that one of the jarfalla failed to feed paper and passport. Usually they use this jarfalla for DPT process but now jarfalla failed to do the process. But PMA also failed to do at that jarfalla. Now they are using another jarfalla since that jarfalla can be use for both process. They already informed this pronlem to Rosdi and Rosdi also informed that this jarfalla cannot be use. But when ask user, they still not try to do test print. So i ask user to do test print first. User need guidance to do test print so mr ng ask to call process room number since now ehe is using line from counter."', '', ' ', '', NULL),
(51, 85, 'SN', 0, '2010-01-26 17:37:58', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"After discuss with Suzie and Dina, suzie suggest to sent the roller to the site since kak shima know how to replace it. Call kak shima, and she agree. I will courier the roller tomorrow morning via nationwide."', '', ' ', '', NULL),
(52, 85, 'SN', 0, '2010-01-26 17:28:38', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call kak Shima and she informed that after take all ok roller and put inside T1, no line appear. Will discuss first about this case. And for this moment ask user to use only one printer. User agree."', '', ' ', '', NULL),
(53, 85, 'SN', 0, '2010-01-26 17:07:04', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Kak Shima. She informed that both toppan appear white line on passport photo. She try to clean many times but line still appear. He found that at T1, cleaning roller B (green) have black mark and cleaning roller A/C (yellow) have black mark on it. She try to remove the black mark but still cannot be remove. She suspect the line cause by this black mark. Ask user to take all roller that ok and try to one printer to make sure that the line is caused by the mark. She will try and will call back later."', '', ' ', '', NULL),
(54, 86, 'SN', 0, '2010-01-26 17:43:43', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Speak with EnZakaria.. He informed that book stuck inside E2000. After restart, passport out with data but appear line on the passport photo. And he found one unknown object inside the E2000. He ask to sent engineer tomorrow morning as Efa ADUKOM informed before."', '', ' ', '', NULL),
