(133, 72, 'SN', 0, '2010-01-21 13:10:00', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"As perdiscuss with En razi, he ask to loan the OKI from new site installation to be replace at site first. Status of unit is loan. Faizal will fine new unit for loan unit."', '', ' ', '', NULL),
(134, 72, 'SN', 0, '2010-01-21 13:59:59', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Azlan. Informed him the update. He informed that Din will come to office tomorrow to take the OKI and will sent to site tomorrow."', '', ' ', '', NULL),
(135, 72, 'SN', 0, '2010-01-21 13:06:28', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"As per informed by Azimah TARGET, there is no loan unit to be replace at site. One loan unit borrowed by HTP but not return yet. Other OKI in office is already set to be sent at new site installation."', '', ' ', '', NULL),
(136, 72, 'SN', 0, '2010-01-21 13:04:53', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Azlan. He informed that user request to change new OKI since their OKI in process room for sah keluar already cannot use for about a month. They do sah keluar manually. Informed Azlan that will check the availability of OKI printer first."', '', ' ', '', NULL),
(137, 68, 'SN', 0, '2010-01-21 12:04:27', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received CM report from Arham via sms. He arrived at site around 9:30am. He check all sensors, all in range.. Done general cleaning. For T1 he change ID6 from -6 to -10 and ID22 from 15 to 13. Now both toppan running well. But today user not open counter today."', '', ' ', '', NULL),
(138, 70, 'SN', 0, '2010-01-21 13:55:18', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received sms from Rosdi. He just arrived at site."', '', ' ', '', NULL),
(139, 68, 'SN', 0, '2010-01-21 17:24:31', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user to update status but not pickup."', '', ' ', '', NULL),
(140, 70, 'SN', 0, '2010-01-21 15:54:28', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received sms from Rosdi. Informed that 2 problem occured.\n1. Book feed error.\n2. Print on use laminate.\nBoth problem resolved."', '', ' ', '', NULL),
(141, 73, 'SN', 0, '2010-01-21 16:52:40', 11, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Action take:\n\n1. uncheck automatically restart\n2. connect to internet and run windows update\n3. delete files in the folder c:windowsminidump\n4. defragment\n5. unplug IDE cable from CD-ROM"', '', ' ', '', NULL),
(142, 73, 'SN', 0, '2010-01-21 17:00:05', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"This problem is juat and update for the PC problem at site. Engineer found this problem during PM at site and they bring back the PC to Software team. We not know this problem since Engineer just refer this problem to software team directly. Faizal informed us about this problem since software team need to update the performance of faulty CPU that in service by them now. Software team already gave loan unit of PC to Ashok to be use on site before faulty PC in service."', '', ' ', '', NULL),
(143, 71, 'SN', 0, '2010-01-21 12:40:59', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Task assign to Azhar TARGET; standby for this week."', '', ' ', '', NULL),
(144, 71, 'SN', 0, '2010-01-21 12:25:28', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"En Radzi inform he received a call form CPIN inform the status - unresolved. Need assignment of job."', '', ' ', '', NULL),
(145, 71, 'SN', 0, '2010-01-21 12:38:39', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Inform status to En Radzi - clearly NOT down for one week but they not USE it for almost one week."', '', ' ', '', NULL),
(146, 70, 'SN', 0, '2010-01-21 11:24:07', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received sms from Rosdi. Already in a flight to site."', '', ' ', '', NULL),
(147, 70, 'SN', 0, '2010-01-21 11:00:55', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user to informed the arrival of engineer because of flight delay. User noted."', '', ' ', '', NULL),
