(149, 71, 'SN', 0, '2010-01-21 12:29:23', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"As per discussion between Suzie and En Razi, en razi ask to assign Din to look on site today. Suzie call Din and assign him to go look onsite today."', '', ' ', '', NULL),
(150, 71, 'SN', 0, '2010-01-21 11:44:38', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Spoke with Asni informed that until now they use T2. They already clean many times but still not ok. For now ask user to check ribbon since user informed that the physical of the ribbon is not really good. Ask user to check first and will call back later."', '', ' ', '', NULL),
(151, 71, 'SN', 0, '2010-01-21 11:03:51', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from En razi. He informed that user report to him that priner cannot be use because of line problem since last week. "', '', ' ', '', NULL),
(152, 68, 'SN', 0, '2010-01-20 17:09:57', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received sms from Arham. He arrived at site around 16:45pm. Upon arrival, both toppan already in use. But user ask Arham to standby at site tomorrow."', '', ' ', '', NULL),
