(154, 69, 'SN', 0, '2010-01-20 16:14:16', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Rizal. He informed that problem resolved. Allow us to close log."', '', ' ', '', NULL),
(155, 66, 'SN', 0, '2010-01-20 16:14:31', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Rizal. He informed that problem resolved. Allow us to close log."', '', ' ', '', NULL),
