(158, 70, 'SN', 0, '2010-01-20 16:20:48', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Rosdi. Assign him to go on site tomorrow morning."', '', ' ', '', NULL),
(159, 70, 'SN', 0, '2010-01-20 16:18:27', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user speak with En Razlan. He informed that at first laminate not stick to the passport so he change to a new film. After change a new film, can print 1 passport but suddenly, film and ribbon roll reversely. Sufian guide user to do transfer mark adjustment and after that can print one passport. For the second passport, book stuck inside printer and error appear, CHECK PRINTER S7 error. He try to change to maintenance mode. user will try print first and will call back user later."', '', ' ', '', NULL),
(160, 70, 'SN', 0, '2010-01-20 16:05:03', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Suzie received call from Sufian informed that there is a problem at site. Sufian already guide user to do transfer mark adjustment. sufian ask to follow up with user."', '', ' ', '', NULL),
(161, 69, 'SN', 0, '2010-01-20 14:04:17', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received sms from Din. He informed that when he arrived at site for Cm log 1001-66(L), found dislocation happened. After done cleaning and transfer mark adjustment, problem resolved. Now in monitoring process."', '', ' ', '', NULL),
(162, 66, 'SN', 0, '2010-01-20 14:04:33', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received sms from din. He informed that problem already resolved. Now in monitoring process. New problem occur. Refer log 1001-69(L)."', '', ' ', '', NULL),
(163, 68, 'SN', 0, '2010-01-20 14:46:47', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call arham to just g check at site first to see the real problem."', '', ' ', '', NULL),
