(165, 68, 'SN', 0, '2010-01-20 14:04:14', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Pn Zaida. She informed that two book stuck at PO unit. Restart not help passport out. User have to pull passport manually and cause the peel off. Will check with engineer first and will call user back."', '', ' ', '', NULL),
(166, 68, 'SN', 0, '2010-01-20 14:03:29', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"En Razi informed that he received report from ... mentioned that both toppan cannot be use."', '', ' ', '', NULL),
