(169, 67, 'SN', 0, '2010-01-20 11:18:25', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Pn Dayang many time but line keep enganged."', '', ' ', '', NULL),
