(194, 54, 'SN', 0, '2010-01-18 16:57:32', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received CM worksheet from Azhar:\nDiplomatic passport feed 2 passport simultaneously from PF. Azhar re-adjust book gate from 64pages to 32 pages."', '', ' ', '', NULL),
(195, 53, 'CM', 0, '2010-01-18 11:40:00', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-15 12:15:00', '2010-01-15 16:15:00', '', '"Received CM report from Din. Line on data page of the passport printed. \nAction taken:\n1. Took all cleaning rollers. \n2. All rollers and thermal head were cleaned.\n3. Test print.\n4. Production monitored.\nPassport production run as expected."', '', ' ', '', NULL),
