(197, 56, 'CM', 0, '2010-01-18 13:59:33', 14, '0000-00-00 00:00:00', '', NULL, '2010-01-18 11:15:00', '2010-01-18 13:00:00', '', '"Received CM worksheet from Yusuf:\nError WARNING CHECK FILM appear during investigation and observation. Platen roller inspect and SP1 test performed and noticed the movement of platen roller not simultaneously rotate. New platen replaced with serial 82-091-01"', '', ' ', '', NULL),
(198, 54, 'CM', 0, '2010-01-18 14:13:47', 14, '0000-00-00 00:00:00', '', NULL, '2010-01-18 09:29:00', '0000-00-00 00:00:00', '', '"Call Azhar at site and pass to Liza - more than 9 passport for "pasport rasmi" and "pasport diplomatik" continue. Liza allow to close log."', '', ' ', '', NULL),
