(201, 61, 'SN', 0, '2010-01-18 13:58:42', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Kak Has mobile to confirm actual status. According to her, at first HTP covering network PM and after done, user try to continue production but our toppan not respond accordingly. After she restart spooler workstation and restart E2000 - production continue. Log resolved by user."', '', ' ', '', NULL),
