(507, 12, 'SN', 0, '2010-01-06 14:54:25', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Anuar. He informed that 2 passport printed wrong. 21242108 -> 21242100\n21242148 -> 21242140\nHe already call Faizal because before this all passport popup. Faizal ask to change the setting but after Anuar change the setting that informed by Faizal, 2 passport printed wrong. "', '', ' ', '', NULL),
