(511, 9, 'CM', 0, '2010-01-06 09:00:34', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-05 12:00:00', '2010-01-05 17:30:00', '', '"Received CM report from Azzeri. Book jam error2 09001. Passport printed not proper. Peel off.\nAction taken:\n1. Measure sensor S7, S12, S13 and S14.\n2. Change nip offset to be 70.\n3. Change ID09, ID56, ID57 and ID58 from parameter setting.\n4. Perform cleaning procedure.\nProduction continue as usual."', '', ' ', '', NULL);
