(512, 6, 'CM', 0, '2010-01-06 09:00:01', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-05 10:30:00', '2010-01-05 16:30:00', '', '"Received CM report from Anuar. Problem facing is dislocation and PF2 SP JAM.\nAction taken:\n1. Done crystagram adjustment.\n2. Platen belt for platen roller readjust.\n3. PF2 tested using spooler.\n4. Done general cleaning.\n5. Done test print.\n6. Production monitored.\nNo more dislocation. PF2 failure. Printer in good condition. Production run as usual.\n* Use PF2 from T2. At first take it to test but user refuse to put it back because they dont want to stop production since a lot of production to do."', '', 'Need to bring PF2 loan unit A.S.A.P. Need to test the faulty unit at target office A.S.A.P.', '', NULL),
(513, 7, 'CM', 0, '2010-01-06 09:00:46', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-05 10:30:00', '2010-01-05 16:30:00', '', '"Received CM report from Anuar. 64 pages passport stuck between E2000 and CCD. BOOK FEED ERROR.\nAction taken:\n1. Done general cleaning.\n2. Train user how to put 64 pages passport inside PF2.\n3. Done test print.\n4. Production monitored.\n5. Change S12.\nCM - success. Printer in goog condition. No more stuck for 64 pages passport. Production run as usual."', '', 'PF2 for this printer is borrowed to be test at T1 since PF2 at T1 failed to feed 64 pages passport. And user refuce to change it back because too bz to stop the production. So now PF2 at This printer is use at T1. Will be replace back today.', '', NULL),
(514, 9, 'SN', 0, '2010-01-06 09:44:56', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user speak with Faris. He in form that status of printer thsi morning, ok. No problem. Allow us to close log."', '', ' ', '', NULL),
