(518, 11, 'CM', 0, '2010-01-05 16:32:13', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-05 15:00:00', '2010-01-05 15:50:00', '', '"Received CM report from Sufian. He already change new monitor at site. Monitor work ok. Faulty monitor S/N: 23 - ZKC93."', '', ' ', '', NULL),
(519, 6, 'SN', 0, '2010-01-05 15:28:25', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Recieved call from Anuar, the root cause of the problem come from PF2 feeder. When user send 64 pages job, PF2 feed the passpot and stop before transfer into CCD and feed the next book again. It cocur even no job send for 64pages from spooler. Anuar did replace other PF2 from other toppan, it feeding well. Replacement of loan unit for PF2 require."', '', ' ', '', NULL),
(520, 5, 'CM', 0, '2010-01-05 15:21:35', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-05 09:20:00', '2010-01-05 13:30:00', '', '"Received CM report from Isyraf. Found that dot print on data pages. Intermittent problem. Effected the production.\nAction taken:\n1. Done test print.\n2. Done cleaning procedure.\n3. Cleaning the heat roller (Black) but failed to solve.\n4. Change with new platen roller.\n5. Success to solve.\nNo more dotted print on data pages. Printer in good condition. Production continue smoothly without problem."', '', ' ', '', NULL),
(521, 4, 'CM', 0, '2010-01-05 14:21:07', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-04 15:30:00', '2010-01-04 17:00:00', '', '"Received CM report from Arham via fax. Film Empty error.\nAction taken:\n1. IO did wrong way when install new film.\n2. Reinstall film.\n3. Monitor productions.\nProblem solved. Printer in good condition."', '', ' ', '', NULL),
(522, 8, 'CM', 0, '2010-01-05 13:58:28', 27, '0000-00-00 00:00:00', '', NULL, '2010-01-05 10:45:00', '2010-01-05 13:00:00', '', '"Received CM report from Yusuf via email. Jarfalla PC failed to boot OS.\nAction taken:\n1. Tried to load OS one more time, but still fail to boot OS.\n2. Entered BIOS mode, from the boot device list noticed that there was no hard disk detected.\n3. All power cables to the hardrives(inside the CPU) were disconnected except for hard disk, mainboard and network.\n4. Reset the BIOS(by short circuit JBAT jumper).\n5. Restarted the PC, and OS was successfully entered.\nThe PC run as usual.\n"', '', 'Weird sound coming from the hard drive during  OS boot process, need to be replaced(hard disk) if the problem persist.', '', NULL),
(523, 11, 'SN', 0, '2010-01-05 14:03:10', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Sufian on the way to site. Send replacemnent unit. Lenovo wide LCD monitor. Model : 6318HB1. S/N : V2DRR09."', '', ' ', '', NULL),
(524, 8, 'SN', 0, '2010-01-05 13:44:19', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call ADUKOM. Log close with talib."', '', ' ', '', NULL),
