(533, 10, 'SN', 0, '2010-01-05 11:44:37', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Azhar. He informed that user report at to him that passport failed to pass CCD. But only for 64 pages passport. He already guide user to add washer and put the paper at the transfer stage cover. But still nit ok. He ask to follow up with user."', '', ' ', '', NULL),
