(575, 2, 'SN', 0, '2010-01-04 10:42:52', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Mdm Chan. she informed that 3 passport print dislocation. She dont want to try anymore afraid many book damage."', '', ' ', '', NULL),
(576, 1, 'SN', 0, '2010-01-04 10:55:14', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call En Hamidi mobile. He not try yet. No production yet."', '', ' ', '', NULL),
(577, 1, 'SN', 0, '2010-01-04 10:50:25', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call En Hamidi mobile. Check in My document, no mapping. Guide him to startoppan in Startup. He do and mapping appear. But he cannot test production since no application to test. All passport that cannot print before already do selenggara and print at other printer. He ask to call back later to update status."', '', ' ', '', NULL),
(578, 1, 'SN', 0, '2010-01-04 10:42:27', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Mdm Chan. She informed that all name insert spooler after imbas but not print. Check 9000 all imbas. Mdm Chan pass phone to En hamidi. En hamidi ask to call his mobile number. 0129395825."', '', ' ', '', NULL),
(579, 190, 'CM', 0, '2010-02-24 16:56:05', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-24 11:15:00', '2010-02-24 16:00:00', '', '"Received CM report from Arham via fax. Jarfalla cannot on (intermittent). After on (1 minute) Jarfalla turn off by itself.\nAction taken:\n1. Change power supply with jarfalla  S/N:4580005.\n2. Monitor production.\nProblem solved. Jarfalla can be used normally."', '', 'Need to send jarfalla (S/N:4580005) to office for repair ASAP.', '', NULL),
(580, 184, 'SN', 0, '2010-02-25 09:39:23', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received CM report from Yusuf. He on site 2 days. 23 and 24/02/2010. Problem peel off. \nAction taken:\n1. Reduced nip offset from 80 to 75.\n2. on 23/02 - from A22051001 to A22051133 printed with 0 peeled off.\n3. On 24/02 - 120 from 119 application 0 peel off.\nContinue production. No peel off."', '', 'THE CVS file from both toppan were taken back for further investigation.', '', NULL),
(581, 186, 'CM', 0, '2010-02-25 17:26:22', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-24 09:10:00', '2010-02-24 12:30:00', '', '"Received CM report from Sufian. FILM EMPTY error display during printing. Transfer mark adjustment complete.\nAction taken:\n1. Test and check crystagram amplifier.\n2. Did crystagram adjustment.\n3. Test print and monitor production.\nProduction continue as usual."', '', ' ', '', NULL),
(582, 197, 'CM', 0, '2010-02-25 17:26:23', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-25 10:10:00', '2010-02-25 16:45:00', '', '"Received CM report from Sufian. Book stuck between feeder and CCD.\nAction taken:\n1. Did general cleaning for CCD and feeder\n2. Did allignment.\n3. Feed test and monitor production.\nProduction continue as usual."', '', ' ', '', NULL),
(583, 192, 'CM', 0, '2010-02-25 17:26:27', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-25 10:10:00', '2010-02-25 17:00:00', '', '"Received CM report from Sufian. Dislocation problem. He did check belt for platen roller. Did general cleaning. Test print and monitor production. Production continue as usual."', '', ' ', '', NULL),
(584, 185, 'SN', 0, '2010-03-01 09:46:36', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Nippon. Spoke with Anand. They already come to sent cleaning kits to our office."', '', ' ', '', NULL),
(585, 198, 'SN', 0, '2010-03-01 09:15:29', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Informed the problem to Maria. She will check this."', '', ' ', '', NULL),
(586, 198, 'SN', 0, '2010-03-01 08:36:58', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Spoke with PIT Raja. She informed that one of the encode PC failed to boot window. Check with user this PC dont have our sticker but this one is big type. Not Netvista.\n\n*Now at site cannot do production. SYSTEM DOWN."', '', ' ', '', NULL),
(587, 198, 'SN', 0, '2010-03-01 08:33:23', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received log from Zana ADUKOM. She informed that PC toppan failed to boot up."', '', ' ', '', NULL),
(588, 196, 'SN', 0, '2010-03-01 09:30:41', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call User spoke with Kak Arnida. She informed that until now, no problem happened anymore. Allow us to close log."', '', ' ', '', NULL),
(589, 196, 'SN', 0, '2010-02-27 10:58:51', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"I attend site together with Sufian and Anuar for ICAO installation. I informed the problems to Anuar and ask him to look at this problem. He check the film and found the problem. He adjust the tension of platen timing belt and do test print. Problem resolved. "', '', ' ', '', NULL),
(590, 197, 'SN', 0, '2010-02-25 15:09:13', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call ADUKOM. Log close with Irwan."', '', ' ', '', NULL),
