(592, 197, 'SN', 0, '2010-02-25 15:06:48', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Spoke with PIT Chan. She confirmed that no problem happened anymore. Allow us to close log."', '', ' ', '', NULL),
(593, 197, 'SN', 0, '2010-02-25 14:48:22', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Sufian. Problem already resolved around 2 pm. He did clean CCD and feeder, problem resolved."', '', ' ', '', NULL),
(594, 185, 'SN', 0, '2010-02-25 14:39:59', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Dian. Informed her that we have problem with the delivery item. Informed her that we can only sent item next monday. Since they still left one packet, user agree."', '', ' ', '', NULL),
(595, 185, 'SN', 0, '2010-02-25 14:35:57', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call  Nippon since until now we still not received item. Spoke with Anand. He informed that actually they already sent item but at Bhgn H. When he found that its wrong, they take it back and only can sent it Monday morning because now the deliverer need to sent other items at Bangi. Ok agree with him but Anand promise to sent items monday morning."', '', ' ', '', NULL),
(596, 193, 'SN', 0, '2010-02-25 14:26:09', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call En Ramli. problem still not ok. User lareday refer problem to BTMR. BTMR still try to resolved it. Since the problem is regarding the agihan, pass problem to BTMR. Log close at our site but i will keep updating status with user."', '', ' ', '', NULL),
(597, 197, 'SN', 0, '2010-02-25 13:36:31', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"call process room. Sufian already at process room troubleshoot problem."', '', ' ', '', NULL),
