(599, 197, 'SN', 0, '2010-02-25 12:52:04', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with mdm kim, she informed that book stuck inside feeder when book move into CCD. User already use sand paper and adjust passport physical but still not ok. Informed her that Sufian at WPIN (B) now. I will ask Sufian to check at site."', '', ' ', '', NULL),
