(601, 192, 'SN', 0, '2010-02-25 13:37:05', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Speak with PIT latifah. She confirmed with Abu, no problem occur anymore. Allow us to close log."', '', ' ', '', NULL),
(602, 196, 'SN', 0, '2010-02-25 12:15:36', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Kak Arnida. She informed that problem still not resolved. She dont want to try anymore since 10 passport already damage at this printer today. Want to guide user to do SP1 platen but she refuse because she really busy now. She informed that engineer can come on saturday together with ICAO installation."', '', ' ', '', NULL),
(603, 195, 'SN', 0, '2010-02-25 12:15:26', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user speak with kak Arnida. She confirmed that now she use this printer. Allow us to close log since a lot of passport already print at thsi printer."', '', ' ', '', NULL),
(604, 196, 'SN', 0, '2010-02-25 10:46:35', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Kak Arnida. Ask her to clean platen roller and orange roller because she dont know that she need to clean that. User ask to call back later around 12 am."', '', ' ', '', NULL),
(605, 195, 'SN', 0, '2010-02-25 10:46:38', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Process room. Speak with Kak Arnida. She informed that line appear this morning but after clean, ok. After 3 passport line appear again with one passport print with blur photo. Ask user to clean again. Concerntrate at thermal head and also clean at platen roller. Will call back later around 12:00hrs."', '', ' ', '', NULL),
