(608, 194, 'SN', 0, '2010-02-25 09:44:23', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Irwan ADUKOM. He give this problem but i explained to him that this is server problem. He noted and will esculate to other vendor."', '', ' ', '', NULL),
(609, 194, 'SN', 0, '2010-02-25 09:36:27', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Hafiz mobile. He check both PC imbasan and PC spooler, both have mapping. Since at the encode indicate server problem. Ask Maria and he think that its because of the server. Ask user to log problem to ADUKOM. User noted."', '', ' ', '', NULL),
(610, 194, 'SN', 0, '2010-02-25 09:29:38', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Pn Raja. Pn Raja pass phone to Hafiz. Hafiz explain that after imbas image, job not sent to spooler. Before this problem occur, he facing problem to encode one passport. Error appear Image failed to sent to server. Ask user to check mapping at PC imbasan and PC spooler but user far from Toppan. he ask to call his mobile. "', '', ' ', '', NULL),
(611, 194, 'SN', 0, '2010-02-25 09:27:28', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Azhar. He at Putrajaya now replacing Fakhrul to attend Tender briefing. User report to him that when send job to toppan, all job sent to Toppan 1 eventhough they sent to Toppan 2 and toppan 3. Azhar ask to follow up with user."', '', ' ', '', NULL),
(612, 193, 'SN', 0, '2010-02-25 08:40:57', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call En Ramli mobile. He pass phone to Kak Ros. Kak Ros explain that yesterday evening, a bundle off book finish and they need to use new Bundle. En Ramli already do Agihan to the new bundle but when print appear popup at spooler STOK AGIHAN TIDAK WUJUD, SILA LAKUKAN AGIHAN SEMULA. After they enter passport number, passport out without data. Ask user to check status at UN9000, status alraedy Imbas. Ask user to do agihan semula. And ask user to OFF toppan for a while. User ask to call back after lunch our because now busy at counter."', '', ' ', '', NULL),
(613, 193, 'SN', 0, '2010-02-25 08:36:36', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from En Ramli. He informed that 2 passport print without data. He ask to call back his mobile number to speak with Kak Ros."', '', ' ', '', NULL),
(614, 192, 'SN', 0, '2010-02-25 11:15:51', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Sufian on site. Problem resolved around 10:15hrs. But he need to test first because now he also doing PM for this printer. Later he will update status again."', '', ' ', '', NULL),
(615, 192, 'SN', 0, '2010-02-25 10:03:56', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Sufian call. He just arrive on site. Work in progress."', '', ' ', '', NULL),
(616, 191, 'SN', 0, '2010-02-25 09:14:08', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with PIT Latifah. For this problem, they found that this application is for 32 pages (KIV problem). But they print for 48 pages. That why error appear. So now they already can print passport. Problem is human error. Allow us to close log."', '', ' ', '', NULL),
(617, 191, 'SN', 0, '2010-02-24 17:34:43', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Abu mobile and confirm back with him - he confirmed PIT Latifah did perform agihan semula for the 2nd times. Elaborate its may due to network sending, as they wanted to go back now, Abu inform they will try again tomorrow. If agihan semula already perfromed, the process should be continue and OK."', '', ' ', '', NULL),
(618, 191, 'SN', 0, '2010-02-24 17:23:48', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from PIT Latifah inform on error pop up. Advice PIT Latifah to check status in 9000, then pass to Abu. Abu mention printer not detact as usual thus 5 passport fail to proceed. Clarify back and not E2000 fail to detact - its Agihan Stok problem. PIT Latifah did perform agihan semula for the 2nd times, but still fail to process production."', '', ' ', '', NULL),
(619, 192, 'SN', 0, '2010-02-24 17:36:37', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"After clarification of log 1002 97L - call Abu mobile and inform him Sufian will on site tomorrow. Abu inform, if tomorrow morning printer able to print as usual, he will update immediately."', '', ' ', '', NULL),
(620, 179, 'SN', 0, '2010-02-24 16:32:26', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Setting of "raised by" changed from TARGET NIK to ADUKOM report number."', '', ' ', '', NULL),
