(624, 190, 'SN', 0, '2010-02-24 14:41:08', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Arham. I explained to him that at site regarding to log 1001-93(L), 4170301 taken back by Din to office because print dirty problem and replace with QMIR unit. Refer to log 1002-54(L), jarfalla 4130249 faulty but since at site only have 2 jarfalla workstation, jarfalla QMIR and 4580005 used with both 2 workstation. I promise with user to replace 4130249 next PM. user agree. Today Arham informed suddently jarfalla 4580005 face problem same like before refer log 1002-39(L). So user try to use 4130249. At first ok but suddently no power. So arham take power supply from 4580005 since this jarfalla faulty. Now 4130249 ok.Status resolved. Jarfalla 4580005 face 2 problem that is no power supply and print in one line."', '', 'Need to bring one jarfalla on site during PM32 to replace 4580005 that facing problem.', '', NULL),
(625, 185, 'SN', 0, '2010-02-24 14:15:17', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Anand mobile - he confirm boxed will deliver to our office tomorrow."', '', ' ', '', NULL),
