(627, 186, 'SN', 0, '2010-02-24 13:24:05', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call process room and passs to PIT Raja Nor Sihan - she allow to close log."', '', ' ', '', NULL),
(628, 190, 'SN', 0, '2010-02-24 13:16:13', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Check with Arham cause pervious log - i really not understand why Din bring back jarfalla 4130301 not as previous report for jarfalla 4130249. As Arham also not clear, ask him to check with Din - please refer to log 1002 39L, 1002 40L ad 1002 54L.\n\n* helpdesk give the wrong instruction or engineer not clear on the status"', '', ' ', '', NULL),
(629, 190, 'SN', 0, '2010-02-24 13:14:58', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Arham ask to check status of jarfalla with serial 4580005 - previous repair by CD Sol, this jarfalla printed with missing text."', '', ' ', '', NULL),
