(631, 91, 'SN', 0, '2010-02-24 12:53:30', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from fakhrul. Already setting access card. username for system : Castle, password: Castle. Fakhrul also informed that 5 access card that supply by Dynadi is different and cannot be setting. Fakhrul already guide and teach PI Hafiz how to setting the access card."', '', ' ', '', NULL),
(632, 190, 'SN', 0, '2010-02-24 12:22:52', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Arham. On site now. Investigate the problem."', '', ' ', '', NULL),
(633, 91, 'SN', 0, '2010-02-24 11:59:41', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Fakhrul. He help user to setting access card but failed to enter system since need to enter password. As speak with Pn Ismahan, last time one of DYnadi staff come to repair access door after i informed mis gan that en razi assign them to look on site and pass 5 access card. The person that come to site repair door and also pass 5 access card but not setting. I call Gun to informed about the password and gan will call his person at kuantan to look on site. Pass Gan phone number to Fakhrul. He will call to ask for password."', '', ' ', '', NULL),
(634, 186, 'SN', 0, '2010-02-24 12:00:56', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call process room - status confirm with Norita and she pass to process room. Cik Julida inform printing continue as well but suddenly error occur again. Sufian on progress troubleshooting."', '', ' ', '', NULL),
