(639, 91, 'SN', 0, '2010-02-24 11:07:41', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Inform to Fakhrul via sms - DO already sent at fax no 095736407. Ask favor to check and confirm recipient.\n(a) 31166 31574 key 5582\n(b) 31164 54518 key 3605"', '', ' ', '', NULL),
(640, 186, 'SN', 0, '2010-02-24 11:07:18', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call process room ansd status of printer confirm with Cik Julida - production continue well without problem but not more than 20 passport yet proceed. If such so, I will user again around 12:00hrs to close log."', '', ' ', '', NULL),
(641, 188, 'SN', 0, '2010-02-24 10:55:01', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Zul update status after adjusment of PO - production continue at 10:50hrs."', '', ' ', '', NULL),
(642, 91, 'SN', 0, '2010-02-24 10:32:33', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Fakhrul to check status of this log as no progression update:\nFakhrul inform he not yet pass to user as PIT is not around. Remind him as today (Wed) is his last day standby monitoring at CPIN for ICAO production."', '', ' ', '', NULL),
(643, 188, 'SN', 0, '2010-02-24 10:30:25', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Update status form Zul at site:\nPrinter up for this error around 10:15hrs but Zul inform no production proceed yet for this printer as he found some problem at PO unit that might cause damage to passport."', '', ' ', '', NULL),
(644, 186, 'SN', 0, '2010-02-24 10:39:57', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received sms update from Sufian:\nAt 10:20hrs, this printer up successfully and ready for production. Currently monitoring."', '', ' ', '', NULL),
