(650, 183, 'SN', 0, '2010-02-24 10:13:36', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"After chat with JPIN oficer, call ADUKOM and status confirm with Zana ADUKOM - user had closed this log yesterday."', '', ' ', '', NULL),
(651, 183, 'SN', 0, '2010-02-24 09:55:50', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call process room direct line to check if production down - according to  process room officer, Cik Dayang yesterday noon after several time troubleshooting perform by BTMR Nizam - rolling the film and installed it many times, printer able to be ready and production already continue. This morning more than 20 passport succeed. Pass to Cik Rita and ask if we can close the log, she pass to BTMR Nizam - Nizam confirm he already close the log with ADUKOM yesterday. Will upate with ADUKOM."', '', ' ', '', NULL),
(652, 183, 'SN', 0, '2010-02-24 09:30:10', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Referring to flight schedule - engineer will arrive at Limbang airport around 10:55hrs from Miri - 10:25hrs. Send reminder to Din and Azlan via sms."', '', ' ', '', NULL),
(653, 185, 'SN', 0, '2010-02-24 09:16:51', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Sufian as I did assign him to collect clearance letter from BTMR Faezah. As Sufian at WWNG now, he will pass the letter hopefully this evening. Noted"', '', ' ', '', NULL),
(654, 188, 'CM', 0, '2010-02-24 09:52:45', 14, '0000-00-00 00:00:00', '', NULL, '2010-02-24 09:45:00', '0000-00-00 00:00:00', '', '"Call Zul - just reached at site around 09:45hrs."', '', ' ', '', NULL),
