(667, 120, 'CM', 0, '2010-02-23 16:29:16', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-08 13:00:00', '2010-02-08 17:00:00', '', '"Received CM report from Zul. PF1 SP JAMMED. Diagnosis found S13 is too high : 1.81v. Change S13. Perform service at PF1. Monitor production. Production continue. printer in good condition."', '', ' ', '', NULL),
(668, 173, 'CM', 0, '2010-02-23 16:27:31', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-22 14:30:00', '2010-02-22 16:30:00', '', '"Received CM report from Zul. Reported Film Tube spindal damage. Change new spindal. Production continued."', '', ' ', '', NULL),
(669, 180, 'CM', 0, '2010-02-23 16:25:48', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-22 14:30:00', '2010-02-22 16:30:00', '', '"Received CM report from Zul. Reported film tear off in the middle of printing. He did reduce ID2 from 80 to 77. Production continued."', '', ' ', '', NULL),
(670, 188, 'SN', 0, '2010-02-23 16:25:57', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Zaki. He informed that error FILM EMPTY appear. he change to new film but after close printer cover, error appear again FILM EMPTY. Printer not ready. User informed that he already do transfer mark with marker pen but still not ok. Ask to call back user after 15 minutes and engineer will guide him to do transfer mark adjustment. Agree."', '', ' ', '', NULL),
(671, 189, 'SN', 0, '2010-02-23 16:25:39', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Zaki he informed that printer roll in reverse direction and book stuck inside printer. No error indicate. Ask user to change to new film. Will call back later after 15 minutes."', '', ' ', '', NULL),
(672, 174, 'CM', 0, '2010-02-23 15:58:51', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-23 11:30:00', '2010-02-23 14:00:00', '', '"Received CM report from Zul. Inspect problem with CPU S/N: KHBM5M0. After check no problem with CPU. He just check BIOS setup and battery. Production continue."', '', ' ', '', NULL),
(673, 178, 'CM', 0, '2010-02-23 15:55:24', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-23 11:30:00', '2010-02-23 14:00:00', '', '"Received CM report from Zul. Monitor PC imbasan failed to on. Monitor Failure S/N: 23DW439. Change monitor with loan unit S/N: V2GBF72. Production continue."', '', ' ', '', NULL),
(674, 187, 'SN', 0, '2010-02-23 15:58:55', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Mdm Chan. She informed that she so panic since too many application and suddenly machine 3 and 4  appear error. Thats why she log problem. But after 5 minutes, someone (IO) try to restart RTE8000 and now both machines ok. Informed to user that if problem happened again, just restart RTE and also workstation. User agree and allow us to close log."', '', ' ', '', NULL),
(675, 187, 'SN', 0, '2010-02-23 15:55:25', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Ask Suzanna and Faizal regarding the error. They informed that for camera driver error, the only solutions is to OFF and ON the RTE8000 machines."', '', ' ', '', NULL),
(676, 186, 'SN', 0, '2010-02-23 15:53:12', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Zul arrive at office. Since now already 4pm and as per agree with Hafiz before, he agree if engineer come to site tomorrow morning. Noted."', '', ' ', '', NULL),
(677, 186, 'SN', 0, '2010-02-23 15:32:52', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Zul. On his way from seremban to office. Informed him about the problem. He will come to office first. If have time he will be on site today. "', '', ' ', '', NULL),
(678, 186, 'SN', 0, '2010-02-23 15:30:37', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Hafiz. He informed that error appear. He already enter to maintenance mode and printer ready. But after send job, error appear again. FILM EMPTY. User already do transfer mark with Marker and transfer mark adjustment but failed. maybe same problem with Jakarta and Limabang. Need to do crystagram adjustment. Since now no engineer at office, ask permission from user to sent engineer tomorrow morning. User agree."', '', ' ', '', NULL),
(679, 184, 'SN', 0, '2010-02-23 15:27:07', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Yusuf out from Office."', '', ' ', '', NULL),
(680, 185, 'SN', 0, '2010-02-23 15:05:30', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Dian and inform her - we only able to send packaging probably on Thursday as our items still at custom, not clear yet. As Friday is maulidur rasul, the packets may arrive next week. OK, she consider on the situation."', '', ' ', '', NULL),
(681, 185, 'SN', 0, '2010-02-23 15:02:50', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Rosdi TARGET to double check if he have a balance of packets in his hand - only left one packet."', '', ' ', '', NULL),
