(683, 184, 'SN', 0, '2010-02-23 15:01:27', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Irwan mobile. He informed that his boss ask him to call ADUKOM to ask for an engineer today because public too heavy. Noted. Informed him that engineer will be on site today."', '', ' ', '', NULL),
