(686, 174, 'SN', 0, '2010-02-23 13:45:04', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with En Amin. Confirmed status of CPU ok now. Allow us to close log."', '', ' ', '', NULL),
(687, 174, 'SN', 0, '2010-02-23 12:39:25', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received sms from Zul. He did diagnosis CPU and still in good condition. He not change new CPU. I already informed him that Maria and Faizal alreday check and they suggest to change CPU but as from Zul, he said that he already do some adjustment and from his point of view he think that no need to change CPU. noted.\n\nProblem resolved at 12:08pm and production continue at 12:15pm. "', '', ' ', '', NULL),
