(694, 129, 'SN', 0, '2010-02-23 11:11:01', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received CM worksheet from Arham via Wisma fax line:\nAdditional info on his action taken visit on 11 and 12 Feb - he try to change ID6 but its already -10. Arham decide to change ID41 = 2 to 6, ID6 = -10 to 0, ID22 = 10 to 20. Belt 2 readjust to 385Hz and did changed new filters C05 & C06."', '', ' ', '', NULL),
