(696, 182, 'CM', 0, '2010-02-22 14:44:43', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-17 10:30:00', '2010-02-19 15:00:00', '', '"While on site for log 1002-52(O) found that camera capture image photo with line. he change camera A95 (S/N: 8946108135) with loan unit A620 from Yusuf (S/N: 246104821). He bring back canon A95 to office to repair. Since camera already change and ok on site, log close."', '', ' ', '', NULL),
(697, 174, 'SN', 0, '2010-02-23 10:34:05', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user speak with En Amin. He informed that they not use this PC because they still have another PC imbasan. Informed him that engineer on the way to site."', '', ' ', '', NULL),
