(704, 149, 'SN', 0, '2010-02-23 10:11:36', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Pn Fadilah to check this log since this log pending for a long time. As mentioned by Pn Fadilah, at site only have 2 PC for jarfalla and both PC have jarfalla that can work. This jarfalla no PC. So since that, ask her permission to close this log first and will replace the unit later. User agree."', '', ' ', '', NULL),
(705, 149, 'SN', 0, '2010-02-18 16:49:30', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Din on site to change another jarfalla log 1001-93(L). He check jarfalla but cannot do anything since he only bring one unit loan Jarfalla at site. This jarfalla will be replace when there is an available jarfalla at office."', '', ' ', '', NULL),
