(933, 137, 'SN', 0, '2010-02-11 17:23:38', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user but nobody pickup. I thinl maybe they already back because now already 5pm and i forgot to call earlier since i have sparepart management training."', '', ' ', '', NULL),
(934, 139, 'SN', 0, '2010-02-11 17:53:17', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Din. He informed that he already replace jarfalla JPKR unit at site. Jarfalla work well. ANd he already sent loan unit back to CDSol to check and CDSol promise to give back the jarfalla tomorrow. if have time, Din will take the jarfalla and swap at site tomorrow because he need to take Jarfalla JPKR to JPKR nextweek."', '', ' ', '', NULL),
(935, 121, 'CM', 0, '2010-02-11 17:25:23', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-09 13:00:00', '2010-02-09 14:00:00', '', '"Received CM report from Zul. Problem: PC jarfalla cannot print. Inspect failure of LPT port.\nAction taken:\n1. Install PCI LPT Port.\n2. Update driver.\n3. Test success.\n4. Monitor production.\ncan use jarfalla. Printing success."', '', ' ', '', NULL),
(936, 110, 'CM', 0, '2010-02-11 17:23:17', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-09 13:00:00', '2010-02-09 14:00:00', '', '"Received CM report from Anuar. Problem: Book stucked in the printer and printed in one line.\nAction taken:\n1. Did general cleaning.\n2. Did test print.\n3. Did test print using notepad.\nJarfalla in good condition. Print using original passport - success."', '', ' ', '', NULL),
(937, 136, 'CM', 0, '2010-02-11 17:19:19', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-10 14:23:00', '2010-02-10 18:00:00', '', '"Received CM report from Zul. Problem: Book printed skew. S14 is too high. Book skew caused by the book was produced with stiches not located at the center of the book. \nAction taken:\n1. Adjust retainer guide.\n2. Change S14.\n3. Reposition S13.\nProduction continue. Printing success."', '', ' ', '', NULL),
(938, 149, 'SN', 0, '2010-02-11 13:34:16', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call En faizal. He informed that this problem is same with previous log. This morning he do test print 3 times and its ok. But now not ok. I informed him that I will check first since this problem keep repeating."', '', ' ', '', NULL),
(939, 149, 'SN', 0, '2010-02-11 13:19:40', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call general line, busy. Call Pn Fadilah mobile and she informed that jarfalla print with uncomplete words where example if print "with" it will printed as "w th". As the problem already happened as log 1002-40(L), i will call En Faizal because i already guide him to do test print this morning and problem resolved. Pn Fadilah want to pray."', '', ' ', '', NULL),
(940, 139, 'SN', 0, '2010-02-11 13:57:52', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Din. He already take 2 jarfalla at CDSol and sent to site. But the loan unit jarfalla still cannot be use at site. the other jarfalla is JPKR unit. But since no other jarfalla just use JPKR jarfalla to be replace at site for this moment. The time din take the jarfalla at CDSol, he cannot test the jarfalla because person at CDSol didnt give permission to him to test the jarfalla first. So now he need to sent back the jarfalla at site as informed by En Nasrul."', '', ' ', '', NULL),
(941, 148, 'SN', 0, '2010-02-11 14:00:02', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', ' ', '', NULL),
(942, 148, 'SN', 0, '2010-02-11 13:45:12', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Since do transfer mark with marker pen also not help, Sufian call and guide pak andy to do transfer mark adjustment. But still not ok. Maybe there is a problem with sensor. "', '', ' ', '', NULL),
(943, 143, 'SN', 0, '2010-02-11 17:26:54', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Log close with Hayati ADUKOM."', '', ' ', '', NULL),
