(1029, 123, 'SN', 0, '2010-02-10 09:59:28', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Zul. He on site to install new UPS at site. He informed that in his car have one unit of jarfalla that he and anuar suppose to send at WPIN yesterday they didnt because jarfalla at WPIN found ok. He ask whether he can use that jarfalla to be replace at site since user keep asking about the jarfalla. As agree with Suzie, allow Zul to use that jarfalla at site for this moment."', '', ' ', '', NULL),
