(1031, 132, 'CM', 0, '2010-02-10 09:46:06', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-08 08:30:00', '2010-02-09 14:30:00', '', '"Received CM report from Din. On site on 8 and 9 February 2010. Din on site for log 1002-03(L) found this problem. He performed cleaning inside PF1 and E2000 and do feed test and tets print. Monitor production. Printing success. Production continue as usual."', '', ' ', '', NULL),
(1032, 127, 'CM', 0, '2010-02-10 09:41:35', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-08 08:30:00', '2010-02-09 14:30:00', '', '"Received CM report from Din. Monitor could not display. IBM Thinkvision 6734-AC1 with S/N:23DR595. He did try to swap monitor , CPU, power cable from other workstation to find out the real problem. Found that the real problem is from LCD monitor. He did bring back monitor for repair. He use monitor from counter as aloan unit (Lenovo S/N:V1T0146). Production continue as usual."', '', 'Need to bring back replacement as soon as possible. Din will bring back monitor to site on CNY (16/02/10)', '', NULL),
(1033, 131, 'SN', 0, '2010-02-10 09:59:43', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Zul. On site and IRIS already on site to settle the problem. Log close at our site."', '', ' ', '', NULL),
