(1037, 131, 'SN', 0, '2010-02-10 08:04:57', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Pn Zaiton. She informed that  alot of error appear from printer. He not manage to remember all the error but the last error appear is "FAILED TO PERFORM CARD ACTIVE". Informed her that our engineer (Zulkifli) will be on site today to install new UPS. I will informed the problem to Zul. to check at site."', '', ' ', '', NULL),
