(1292, 331, 'SN', 0, '2010-03-30 16:43:07', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Azhar. He informed that he found problem happened because screw thread at platen timing belt missing. He change new screw but not really stable. Printer running well this morning but suddenly this evening problem repeated. He adjust already and still monitoring. He will be on site again tomorrow."', '', ' ', '', NULL),
