(1310, 332, 'SN', 0, '2010-03-30 08:38:04', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Kak yati. She informed that dislocation happened again and she already clean from yesterday evening. But still not ok. HS eask to sent engineer immediately since both printer occur same problem and her boss already get angry. She also ask to bring together sand paper."', '', ' ', '', NULL),
(1311, 331, 'SN', 0, '2010-03-30 08:38:25', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Kak yati. She informed that dislocation happened again and she already clean from yesterday evening. But still not ok. HS eask to sent engineer immediately since both printer occur same problem and her boss already get angry. She also ask to bring together sand paper."', '', ' ', '', NULL),
(1312, 238, 'CM', 0, '2010-03-29 17:16:43', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-10 09:30:00', '2010-03-10 15:00:00', '', '"Received CM report from Fakhrul. Book feed error and white line.\nAction taken:\n1. Replace teflon tape at PI unit.\n2. Clean the CCD timing belt.\n3. Clean thermal head.\nProduction print."', '', ' ', '', NULL),
(1313, 236, 'CM', 0, '2010-03-29 17:14:07', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-09 12:15:00', '2010-03-09 12:30:00', '', '"Received CM report from Fakhrul. Jura key already expired. He replaced new Jura dongle. Key : 1867. Old key : 1860. Production print success."', '', ' ', '', NULL),
(1314, 325, 'CM', 0, '2010-03-29 17:11:50', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-29 11:25:00', '2010-03-29 13:15:00', '', '"Received CM report from Naufal. CHECK PRINTER R ENC ERROR.\nAction taken:\n1. Transfer mark adjustment performed.\n2. DC3 motor tested.\n3. Test print performed.\n4. Production monitored.\nPrinter in good condition."', '', ' ', '', NULL),
(1315, 321, 'CM', 0, '2010-03-29 17:08:21', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-26 13:00:00', '2010-03-26 17:00:00', '', '"Received CM report from Azhar. Book jammed at printer caused laminate peel off.\nAction taken:\n1. Open PO unit, adjust retainer guide.\n2. Test print.\n3. Monitor production.\nPrinter in good condition. No more error appear."', '', ' ', '', NULL),
(1316, 315, 'CM', 0, '2010-03-29 17:04:26', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-25 17:30:00', '2010-03-25 20:30:00', '', '"Received CM report from Azhar. Allen key for film unit broken. Film unit sensor problem error.\nAction taken:\n1. Remove broken allen key from the hole. \n2. Replace with new.\n3. Open sensor and repair.\n4. Place it back to it position.\nPrinter in good condition. No more error appear."', '', ' ', '', NULL),
(1317, 330, 'SN', 0, '2010-03-29 16:34:38', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call ADUKOM.Log close with efa."', '', ' ', '', NULL),
