(1325, 325, 'SN', 0, '2010-03-29 15:00:17', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Naufal arrived at office. Before he left site, already monitor 20 passport without any probelm. Problem change to resolved."', '', ' ', '', NULL),
(1326, 330, 'SN', 0, '2010-03-29 14:30:03', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Confirmed with Suen. For the error appear because chip problem."', '', ' ', '', NULL),
(1327, 330, 'SN', 0, '2010-03-29 15:01:49', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Pn Salbiah. She try passport at T1 and same problem occur. So she accept that the problem is because of the chip. So advise user to daftar rosak. Log able to close."', '', ' ', '', NULL),
(1328, 330, 'SN', 0, '2010-03-29 14:22:56', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Pn Salbiah. She informed that 2 passports appear this error. I informed him that this is because of chip problem but user cannot accept it. So i ask her to try this 2 books at another printer, if ok that mean not because of chip but if not ok, so user need to accept that the problem is because of chip problem. User will try first and she ask to call back after 30 minutes."', '', ' ', '', NULL),
(1329, 329, 'SN', 0, '2010-03-29 14:16:35', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call ADUKOM. Spoke with Hayati. Informed her this problem is system problem. He will close log at our site."', '', ' ', '', NULL),
(1330, 329, 'SN', 0, '2010-03-29 13:59:31', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call User. Spoke with En Adham. He informed that error appear at spooler for all passport that be imbas at this printer. I informed to him that this problem maybe because of sytem. Will informed ADUKOM about this to esc."', '', ' ', '', NULL),
(1331, 325, 'SN', 0, '2010-03-29 13:38:08', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Naufal SMS - user asked to turn off printer during lunch. If after lunch error appear, he think need to change mecha board because they already test DC motor and its ok."', '', ' ', '', NULL),
(1332, 328, 'SN', 0, '2010-03-29 13:50:46', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Send SMS to Yusuf. Pass user phone number. Ask him to call user."', '', ' ', '', NULL);
