(1334, 328, 'SN', 0, '2010-03-29 13:43:57', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received log from Irwanm ADUKOM."', '', ' ', '', NULL),
(1335, 328, 'SN', 0, '2010-03-29 13:37:40', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Sufian. He informed that he already guide user to put paper at CCD. user will try first. If ok Yusuf can be on site tomorrow. If not Yusuf have to be on iste today."', '', ' ', '', NULL),
(1336, 328, 'SN', 0, '2010-03-29 13:33:14', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user again but still nobody pickup."', '', ' ', '', NULL),
(1337, 328, 'SN', 0, '2010-03-29 13:31:18', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Yusuf. Just out from Anak bukit for lunch. Informed him the problem. He will be on site today if have time."', '', ' ', '', NULL),
(1338, 328, 'SN', 0, '2010-03-29 13:27:57', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Not pickup."', '', ' ', '', NULL),
(1339, 328, 'SN', 0, '2010-03-29 13:24:26', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Sufian. He informed that user report to him that error appear. Before this also appear but after restart printer can ready but now printer failed to ready. Sufian ask to follow up with user and ask Yusuf to be on site since user have 8 application of passport to be deliver today."', '', ' ', '', NULL),
(1340, 323, 'CM', 0, '2010-03-29 12:05:47', 14, '0000-00-00 00:00:00', '', NULL, '2010-03-28 09:45:00', '2010-03-28 15:00:00', '', '"Received CM report by Azlan via email:\n- At Maintenance Mode, TP2:Do test print. Error message Film Empty when we start to do test print.\n- Do Trsmark adjustment several times. Error. (Printer didnÕt detect film eventhough change to new film)\n- Do CR Mark several times and make sure printer to get a fix 9 when film feed to crystagram mark & 0 when film feed elsewhere.\n- Do test print and general cleaning since the printer not clean properly."', '', ' ', '', NULL),
(1341, 322, 'SN', 0, '2010-03-29 13:20:10', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call general line - confirm packaging with Shazana; received."', '', ' ', '', NULL),
(1342, 233, 'CM', 0, '2010-03-29 11:14:46', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-09 10:45:00', '2010-03-09 11:45:00', '', '"Received CM report from Fakhrul. Book stuck and laminate cut off. \nAction taken:\n1. Cut the laminate.\n2. Draw block line at laminate used.\n3. Continue printing.\nProduction continue as usual."', '', ' ', '', NULL),
(1343, 325, 'SN', 0, '2010-03-29 11:41:07', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Naufal and Azhar arrived at WPUT. Faris already do transfer mark adjustment. Warm up and test print ok. They will monitor production first to make sure no problem anymore."', '', ' ', '', NULL),
(1344, 327, 'CM', 0, '2010-03-29 11:04:05', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-23 13:00:00', '2010-03-23 16:00:00', '', '"Received CM report from azlan. On site on 23/03/2010 around 13:00hrs. Printer offline. SCSI card not fully connected. Restart PC ok. Log close since problem already resolved by Azlan on the same day as service. Approved by PIT Misran."', '', ' ', '', NULL),
(1345, 326, 'CM', 0, '2010-03-29 10:57:47', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-23 13:00:00', '2010-03-23 16:00:00', '', '"Received CM report from Azlan. On site on 23/03/2010 around 13:00hrs. Peel off happened because of retainer guide. He change ID9 = 1, ID56 = 4, ID57 = 1 and ID58 = 4. Both printer can print passport successfully. Log close since Azlan alreday get approved by PIT Misran on the same day of CM performed."', '', ' ', '', NULL),
(1346, 309, 'CM', 0, '2010-03-29 10:45:20', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-25 12:00:00', '2010-03-26 16:30:00', '', '"Received CM report from Azlan. He do cleaning, do urutan at passport book, adjust parameter setting ID2 = 78 -> 80. Do monitoring for passport production. Update laporan kerosakan for today - 4 skew, 2 peel off, 1 dislocation an 2 chip."', '', ' ', '', NULL),
(1347, 323, 'CM', 0, '2010-03-29 10:20:47', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-28 00:00:00', '0000-00-00 00:00:00', '', '"Received CM report from Azlan. FILM EMPTY, TRSMARK ERR. Transfer Mark not detected. \nAction taken:\n1. Do CR Mark 3 times and detect as default. Do test print. Do general cleaning. "', '', '', '', NULL),
(1348, 323, 'SN', 0, '2010-03-29 11:09:12', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Kak Yati mobile - she confirm this printer work well. Log close."', '', ' ', '', NULL),
(1349, 325, 'SN', 0, '2010-03-29 10:47:37', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Naufal on the way to site assist by Azhar. Bring DC3 and S11."', '', ' ', '', NULL),
(1350, 325, 'SN', 0, '2010-03-29 10:01:43', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Informed problem to Naufal. He will go on site today."', '', ' ', '', NULL),
(1351, 325, 'SN', 0, '2010-03-29 09:43:03', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Ask Suzie, she said this problem is maybe because of DC motor or encoder sensor. Need to sent engineer to the site."', '', ' ', '', NULL),
