(2014, 229, 'SN', 0, '2010-03-05 16:57:29', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call en izwan mobile. He explain that both PC is encode PC with the small CPU. I informed to user that this PC is IRIS PC. Need to refer this problem to IRIS I will call ADUKOM on behalf of user. User informed that he alraedy give serial niumber of both PC to user."', '', ' ', '', NULL),
(2015, 229, 'SN', 0, '2010-03-05 16:53:05', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received report from Efa ADUKOM. She informed that 2 PC auto shutdown but he dont know which PC. "', '', ' ', '', NULL),
(2016, 228, 'SN', 0, '2010-03-05 17:27:14', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call En ramli. Informed to him that we already sent camera to site. En ramli will informed back when he receive unit."', '', ' ', '', NULL),
(2017, 228, 'SN', 0, '2010-03-05 16:16:04', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Suzie prepare camera to site. S/N: 2246100317. Sent to teh site via fedex. "', '', ' ', '', NULL),
(2018, 228, 'SN', 0, '2010-03-05 15:49:58', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call back en ramli. He informed that problem intermittent. Camera capture image with line. This problem happened same as jakarta. As per discuss with Zul, yusuf and Suzie, need to sent camera to site asap."', '', ' ', '', NULL),
(2019, 228, 'SN', 0, '2010-03-05 15:11:42', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from En ramli. He informed that start from yesterday, canon camera capture image blur. I ask en ramli to adjust prokap stand to be a little bit high. En Ramli will do it first and he ask to call back afetr 30 minutes."', '', ' ', '', NULL),
(2020, 227, 'SN', 0, '2010-03-05 15:43:39', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Suzie received call from user informed that problem repeated. Suzie assign naufal on site on monday (08/03/2010).\n\n[Suzie] According to Hafiz, the problem remain and he request engineer to look on site."', '', ' ', '', NULL),
(2021, 227, 'SN', 0, '2010-03-05 14:09:11', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user after received report from Fakhrul that user report to him that peel off happened but fakhrul already guide user. User informed that now no problem happened anymore. "', '', ' ', '', NULL),
(2022, 165, 'CM', 0, '2010-03-05 16:38:21', 14, '0000-00-00 00:00:00', '', NULL, '2010-02-18 13:30:00', '2010-02-18 23:05:00', '', '"Received CM worksheet from Sufian:\nActual problem is FILM EMPty. Sufian performed TRS MARK ADJ and did some adjustment on ID62, 63, 68, 72 and ID71."', '', ' ', '', NULL),
(2023, 209, 'SN', 0, '2010-03-03 15:22:22', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Receied CM worksheet from Azzeri:\nGeneral cleanng performed inside PF and CCD, parameter ID changed: ID9 as 2, ID56 = 4, ID57 = -2, ID58 = 4."', '', ' ', '', NULL);
INSERT INTO `smart_resolutionnote` (`id`, `ticket_id`, `rsltn_type`, `rsltn_status`, `rsltn_date`, `rsltn_byuser`, `rsltn_servicedate`, `rsltn_servicennumber`, `rsltn_counter`, `rsltn_eta`, `rsltn_etd`, `rsltn_inspection`, `rsltn_actiontaken`, `rsltn_actionmethod`, `rsltn_planning`, `rsltn_remark`, `datemodified`) VALUES
(2024, 226, 'SN', 0, '2010-03-05 14:49:04', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Since this problem resolved by Ashok on site and no other problem reported regarding this problem, log close."', '', ' ', '', NULL),
(2025, 226, 'CM', 0, '2010-03-05 14:36:33', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-22 11:20:00', '2010-02-22 13:45:00', '', '"Received CM report from Ashok. On site on 22/02/10 around 11:20hrs. Problem BOOK ERROR2. \nAction taken:\n1. Change SP2 motor gear.\n2. Test print.\n3. Monitor production.\nProduction continue as usual. Printer in good condition. There is no problem during monitoring process."', '', ' ', '', NULL),
(2026, 221, 'SN', 0, '2010-03-05 14:33:31', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with mdm Chan. Problem repeated. Din still in repairing process. Log not able to close yet."', '', ' ', '', NULL),
(2027, 89, 'CM', 0, '2010-03-05 14:03:34', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-04 11:00:00', '2010-02-04 15:00:00', '', '"Received CM report from Ashok. Problem: PC reboot every morning went start.\nAction taken:\n1. Cleaned ram.\n2. Disable automatic reboot from environment variable.\n3. Test ok.\n4. Monitor production.\nThere is no problem reboot. Production continue as usual."', '', ' ', '', NULL),
(2028, 225, 'SN', 0, '2010-03-05 13:58:28', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Log close since this problem settle at site by Rosdi and no problem reported by anymore for this moment."', '', ' ', '', NULL),
(2029, 225, 'CM', 0, '2010-03-05 13:56:04', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-03 10:00:00', '2010-03-03 17:00:00', '', '"Received CM report from Rosdi. On site on 03/03/10 around 10:00hrs. A small line on the printed passport.\nAction taken:\n1. Cleaned thermal head but problem still remain.\n2. Changed thermal head. S/N: 77-012-01 (QMIR). C:-3, M:-2 and Y:-3. "', '', ' ', '', NULL),
(2030, 216, 'CM', 0, '2010-03-05 09:49:52', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-03 11:30:00', '2010-03-03 18:00:00', '', '"Received CM report from Azzeri. BOOK JAM ERROR 3, dislocation, peel off on PO unit after passport printed. Spooler sometimes missing.\nAction taken:\n1. Done cleaning on platen roller.\n2. Adjust retainer guide to be 1.30 mm. \n3. Change parameter ID setting ID09, ID56, ID57 and ID58.\nProduction continue as usual."', '', ' ', '', NULL),
(2031, 154, 'CM', 0, '2010-03-05 09:37:58', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-23 08:30:00', '2010-02-23 15:00:00', '', '"Received CM report from Rosdi. Monitor sah keluar faulty. No display. \nAction taken:\n1. Changed to loan unit monitor until the origin monitor (faulty monitor) has been repaired.\n2. Loan unit monitor, IBM Thinkvision S/N:V2DRR09."', '', ' ', '', NULL),
(2032, 221, 'SN', 0, '2010-03-05 11:21:42', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Din. 5 passport already print without problem."', '', ' ', '', NULL),
(2033, 221, 'SN', 0, '2010-03-05 09:05:48', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Informed this problem to Din. As discuss with Azhar yesterday, need to do setting for this printer. Ask Din to go change setting for this printer today."', '', ' ', '', NULL),
(2034, 221, 'SN', 0, '2010-03-05 09:01:26', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Haili. Ask her to speak with Mdm Chan but mdm chan go to process room B. Haili informed that problem repeated again this morning but they just try one book. ask her to try  afew books. Will call back after 30 minutes."', '', ' ', '', NULL),
(2035, 221, 'SN', 0, '2010-03-04 17:34:15', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call mdm Chan. she informed that now they using this printer without problem. But they just try 2 passport. For now status change to resolved. User ask to update status again next  morning."', '', ' ', '', NULL),
(2036, 221, 'SN', 0, '2010-03-04 17:15:07', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call mdm Chan. She informed that after use sand paper at left side, printer ok. No peel off but white dot appear. They in cleaning process. Mdm Kim ask to call back after 15  minutes."', '', ' ', '', NULL),
(2037, 221, 'SN', 0, '2010-03-04 16:44:49', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call mdm Chan. She said that they not smooth left area. Ask user to smooth it first and tets. They will try and ask to call back after 30 minutes."', '', ' ', '', NULL),
(2038, 221, 'SN', 0, '2010-03-04 16:43:02', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Din, Din he never change any setting."', '', ' ', '', NULL),
(2039, 221, 'SN', 0, '2010-03-04 16:42:16', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Ask Zul. Zul ask to ask din because din just sent the printer yesterday. "', '', ' ', '', NULL),
(2040, 221, 'SN', 0, '2010-03-04 16:40:15', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Mdm Chan mobile since when i call process room line keep busy. Book peel of a little bit at right site and they use sand paper - ok. After that big peel off happened at left site and cause book jammed inside the printer."', '', ' ', '', NULL),
(2041, 220, 'SN', 0, '2010-03-04 15:45:26', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Status confirm with PIT Yazid by Arham. Log close."', '', ' ', '', NULL),
(2042, 220, 'CM', 0, '2010-03-04 15:41:16', 14, '0000-00-00 00:00:00', '', NULL, '2010-03-03 13:30:00', '2010-03-03 17:00:00', '', '"Received CM worksheet from Arham, at 11:01hrs:\nProblem occur and reported to him yesterday; 03/03 (Wed) and Arham arrive at site 13:30hrs. Blur printing, Arham try to clean E01, adjust A01 belt, add grease at E01 area but effect remain. He decide to replace new A01 (s/n 08g099, old unit 08g040 taken) - production succeed. "', '', ' ', '', NULL),
(2043, 218, 'CM', 0, '2010-03-04 14:47:26', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-04 10:55:00', '2010-03-04 13:25:00', '', '"Received CM report from Maria. She install RTE driver to new QA PC from IRIS (Toppan 1). RTE S/N: 5RL13925. new PC QA \nmodel :8124-MNA\nS/N:L3EK568"', '', ' ', '', NULL),
(2044, 219, 'CM', 0, '2010-03-04 14:47:15', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-04 10:55:00', '2010-03-04 13:25:00', '', '"Received CM report from maria. Problem: laminate too high from actual position.\nMaria setting back films by roll it back with the right procedure. \nProblem resolved."', '', ' ', '', NULL),
(2045, 213, 'SN', 0, '2010-03-04 14:11:54', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received CM worksheet from Azhar:\nOn site 03/03 (Wed) and found white line on data page, cleaning focusing at E01 area helped. Monitoring till the next day, OK."', '', ' ', '', NULL),
(2046, 219, 'SN', 0, '2010-03-04 14:03:40', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call PIT Low.He confirmed that no problem anymore after Maria troubleshoot. Allow us to close log."', '', ' ', '', NULL),
(2047, 219, 'SN', 0, '2010-03-04 13:10:27', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Sufian call Maria. Found that the problem occur because of the way user roll the film. Maria roll back the film and now problem resolved."', '', ' ', '', NULL),
(2048, 218, 'SN', 0, '2010-03-04 11:45:50', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call ADUKOM. Log close with Shima."', '', ' ', '', NULL),
