(2068, 190, 'SN', 0, '2010-03-03 14:37:37', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Prepare DO for jarfalla loan unit S/N:4579977 to be sent to JPIN by Din during ICAO installation starting 7 March 2010. Jarfalla S/N: 4580005 will be taken back to office to repair."', '', ' ', '', NULL),
(2069, 216, 'SN', 0, '2010-03-03 13:56:10', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Azzeri mobile - till now effect remain, if using 32 passport production continue and no jammed occur but if using ICAO passport book jammed at PO unit occur. WIP"', '', ' ', '', NULL),
(2070, 215, 'SN', 0, '2010-03-03 13:56:22', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Azzeri - he confirm this printer running as usual till now. Status will confirm with user as PIT Low is not aroud at the moment."', '', ' ', '', NULL),
