(2074, 216, 'CM', 0, '2010-03-03 12:03:16', 14, '0000-00-00 00:00:00', '', NULL, '2010-03-03 11:30:00', '0000-00-00 00:00:00', '', '"Call Azzeri, arrived at site around 11:30hrs. Status WIP, as observe the real cause of problem for this toppan is BOOK JAM ERROR 3. Advice to check S14."', '', ' ', '', NULL),
(2075, 215, 'CM', 0, '2010-03-03 12:03:38', 14, '0000-00-00 00:00:00', '', NULL, '2010-03-03 11:30:00', '0000-00-00 00:00:00', '', '"Call Azzeri mobile, he arrived at site around 11.30hrs. As inspection, horizontal line occur but cleaning help. Production continue as usual. Status change to resolved."', '', ' ', '', NULL),
