(2081, 216, 'SN', 0, '2010-03-03 10:48:00', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"As Zul need to attend meeting for tender preperation at 11am at TARGET meeting room, task assign to Azzeri to look on site."', '', ' ', '', NULL),
