(2155, 207, 'SN', 0, '2010-03-01 17:14:35', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Abu mobile (012 969 6466) and pass to PIT Latifah - she forget to fax it and she said, Abu will capture the image and send it to Helpdesk mobile. OK"', '', ' ', '', NULL),
