(2172, 206, 'SN', 0, '2010-03-01 14:48:16', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from En Wahid. He ask to send engineer to the site since hsi IO cannot do it."', '', ' ', '', NULL),
(2173, 202, 'SN', 0, '2010-03-01 14:36:30', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Asyraf from Bahagian Keselamatan Passport Bhgn H. He informed that HTP still doing it but until now not resolved yet. Informed Asyraf that since QA selesai thats mean RTE8000 can encode. He understand and will update status back with HTP."', '', ' ', '', NULL),
(2174, 206, 'SN', 0, '2010-03-01 14:51:32', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Task assign to Din to look on site."', '', ' ', '', NULL),
