(2176, 206, 'SN', 0, '2010-03-01 14:36:58', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call general line - status check with Fariz and pass to Azila. She mention she did as advice but printer in process warm up, I wait for a minute but she inform she will give a feedback after this.\n\n* She claim, this printer always stop at everywhere (CCD/E2000/PF) without any error and no process. Its freeze and sometimes, if they not check on it, till night this printer not processing anything."', '', ' ', '', NULL),
(2177, 200, 'SN', 0, '2010-03-01 13:46:22', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received email from faizal. He arrived on site."', '', ' ', '', NULL),
(2178, 205, 'SN', 0, '2010-03-01 14:21:47', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user again. Spoke with Pn Zaiton. Informed her as what Zul have informed me. User will try to refer this problem with IRIS. Log close at our site since we cannot do anything regarding this problem.."', '', ' ', '', NULL),
(2179, 206, 'SN', 0, '2010-03-01 14:23:32', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Azila inform dislocation still occur even she did general cleaning. As what Azila explain - she not clean the platen roller yet. Advice her to focus cleaning at platen area and rolling ribbon panel. She pass to PIT Rashid - I explain to him and En Rashid mention Irwan not around today and all of them not familiar what to do as usually they rotate from counter into process room, only Irwan permanent staff for process room."', '', ' ', '', NULL),
(2180, 205, 'SN', 0, '2010-03-01 13:16:57', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user many time but not pickup."', '', ' ', '', NULL),
(2181, 205, 'SN', 0, '2010-03-01 12:55:27', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"refer problem with Zul. Zul informed that all printer setting with same time but maybe encode cause the printer not same time. Maybe encode for toppan 2 take more time compare with Toppan 1. We cannot do anything but maybe IRIS can check the encode part. Will call user to informed this."', '', ' ', '', NULL),
(2182, 205, 'SN', 0, '2010-03-01 12:53:23', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Spoke with Pn Zaiton. She informed that printer too slow compare to T1. Example : T1 print 6, but at this printer only 4. Informed user that thsi maybe because engineer want to avoid peel off happened. I will check with engineer first and will call user back."', '', ' ', '', NULL),
(2183, 202, 'SN', 0, '2010-03-01 13:12:31', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Zana ADUKOM. She already esc problem to hiari HTP. Noted. Log close at our site."', '', ' ', '', NULL),
