(2189, 200, 'SN', 0, '2010-03-01 12:16:54', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Faizal on the way to the site."', '', ' ', '', NULL),
