(2192, 204, 'SN', 0, '2010-03-01 12:24:41', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received CM worksheet from Azhar today:\nProblem occur on 22/02/10 (Mon) during standby for ICAO production. As peel off problem seldom occur, Azhar advice user to use sand paper if necessary."', '', ' ', '', NULL),
(2193, 203, 'SN', 0, '2010-03-01 12:20:12', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Log close as this problem had resolved on the same day of reported."', '', ' ', '', NULL),
(2194, 203, 'SN', 0, '2010-03-01 12:12:16', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"This is a back date log as I just received this CM worksheet from engineer today;\nLog reported by user on 17/02/10 (Wed) relate to log 1002-63(L). Isyraf on site at 13:45hrs and did TRS MARK ADJ, cleaned fiber optic sensor and perform general E2000 cleaning. \n\nRespond from TPPI Wahid:\nFailure of machine being reported at 09:15hrs. Result is massive delay of passport being processed. Adukom no 171024."', '', ' ', '', NULL),
(2195, 201, 'SN', 0, '2010-03-01 11:30:33', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Azhar informed that he already guide Maria to do test print but failed. Jarfalla pull passport but not print. Need to send Jarfalla to replace at site. \n* Have 2 old jarfalla taken from site because at site use new jarfalla. But new jarfalla cannot use for UN 1300. So azhar bring one old jarfalla to the site to use for UN1300. This log is a problem to that jarfalla. Will send another old jarfalla to the site replace thsi problem jarfalla. Azhar will sent jarfalla to the site. Test by Azzeri. S/N: 4579977."', '', ' ', '', NULL),
(2196, 201, 'SN', 0, '2010-03-01 11:21:22', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Maria to update status for log 1003-01(L). She also informed that jarfalla failed to print. Maria informed that now azhar guide user. "', '', ' ', '', NULL),
(2197, 199, 'SN', 0, '2010-03-01 11:41:47', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Lina. She call to informed about other problems. Refer to log 1003-03(L). But i confirmed this problem with her. many passport already printed without no more dislocation problem. Lina allow to close log for this problem."', '', ' ', '', NULL),
(2198, 198, 'SN', 0, '2010-03-01 12:00:15', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call ADUKOM. Log close with Najib."', '', ' ', '', NULL),
(2199, 198, 'SN', 0, '2010-03-01 11:21:14', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call Maria. She informed that is a human error. PC failed to boot windows because user enter wrong ID. They enter ID for Spooler at encode PC. The time Maria arrive at site, they already can use that PC. Log close because problem resolved and human  error."', '', ' ', '', NULL),
(2200, 200, 'SN', 0, '2010-03-01 11:10:41', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Informed problem to Faizal. H ethink maybe dongle faulty. He will be on site today to change new dongle."', '', ' ', '', NULL),
(2201, 200, 'SN', 0, '2010-03-01 10:47:19', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Azlin.She informed that error appear and printer  not pull passport. Ask Faizal. Faizal ask to remove dongle and plug in back and restart PC spooler. Use try but save and config menu not appear. Guide user to check SCSI cable. After user check SCSI cable, error Dongle Error No. 1991 appear again. And lamp at dongle appear red not green. Will check with faizal fisrt and will informed user back."', '', ' ', '', NULL),
