(2204, 110, 'SN', 0, '2010-03-01 10:04:41', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received CM worksheet from Azhar today."', '', ' ', '', NULL),
(2205, 112, 'SN', 0, '2010-03-01 09:58:10', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received CM worksheet from Azhar on action taken, 05/02/10:\nEven no symptom as occur, he did readjust book in white roller at PI unit, and added small piece at transfer stage. Feed - succeed."', '', ' ', '', NULL),
(2206, 188, 'CM', 0, '2010-02-24 18:00:01', 27, '0000-00-00 00:00:00', '', NULL, '2010-02-24 09:45:00', '2010-02-24 13:00:00', '', '"Received CM report from Zul. Problem: FILM EMPTY after change new film. Printer did not recognize new film.\nAction taken:\n1. Draw transfer mark at new film.\n2. Performed TRS Mark Adjustment (Solved).\n3. Perform RIBBON LEVEL ADJ and CR MARK ADJ to make sure printer in good condition.\n4. Monitor production.\nProblem solved. Production continue. Printing success."', '', ' ', '', NULL),
