(2710, 287, 'CM', 0, '2010-04-07 16:28:32', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-19 13:15:00', '2010-03-19 17:00:00', '', '"Received CM report from Yusuf. Problem MEDIA FEED ERROR, BOOK FEED ERROR 1 and CHECK CAMERA UNIT.\nAction taken:\n1. Took out printer cover. Pass sensor voltage measured.\n2. Feed test with CCD cover opened.\n3. Reposition CCD exit lip.\n4. 20 passports successfully feed.\n5. 60 passport successfully print with no damage.\nProduction run as usual."', '', ' ', '', NULL),
(2711, 231, 'CM', 0, '2010-04-07 16:25:08', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-08 14:20:00', '2010-03-08 16:15:00', '', '"Received CM report from Yusuf. On site found that peel off happened because passport stuck inside printer.\nAction taken:\n1. Increased retainer clearence.\n2. Reduced nip pressure from 80 to 78.\n3. Increase ID9 from 1 to 3.\n4. Production monitored.\nProduction run as expected."', '', ' ', '', NULL),
