(2715, 230, 'CM', 0, '2010-04-05 15:50:02', 27, '0000-00-00 00:00:00', '', NULL, '2010-03-09 11:30:00', '2010-03-10 10:00:00', '', '"Received CM report from Rosdi.\nAction taken:\n1. Checked thermal head.\n2. Did some adj to the thermal head ( Peel bar and shim thickness).\n3. Put a grease to the thermal head shaft.\n4. Test print and monitor production."', '', '', '', NULL);
