(3025, 513, 'SN', 0, '2010-05-18 14:08:38', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Assign Azhar to test thermal head to be sent to Naufal. S/N: 94-035-01."', '', ' ', '', NULL),
(3026, 513, 'SN', 0, '2010-05-18 14:10:29', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Informed naufal to take the unit at terminal bus kota bharu tomorrow morning around 9 / 10 am. He agree. He ask to prepare thermal head with R = 3737."', '', ' ', '', NULL),
(3027, 513, 'SN', 0, '2010-05-18 13:25:52', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call transnational. Need to sent to Bengkel transnational at jeramat before 7 pm to make sure thermal head will arrived at kota bharu terminal and to be pickup around 9 / 10 am tomorrow morning. Zul will sent the unit to transnational keramat."', '', ' ', '', NULL),
(3028, 513, 'SN', 0, '2010-05-18 13:04:31', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"As perdiscuss with suzie and others will send thermal head to the site via bus (Transnational). "', '', ' ', '', NULL),
(3029, 513, 'SN', 0, '2010-05-18 13:00:51', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Naufal. On site doing PM. Found this problem. Ask whether we can sent a thermal head to the site."', '', ' ', '', NULL),
(3030, 511, 'SN', 0, '2010-05-18 09:50:19', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call EN Ridzuan mobile. He informed that the problem already settle. This problem always blue screen every morning. He report becaus ehe afraid that this pronlem will become more worst. But since no problem occur anymore, log will be close."', '', 'Ask Azzeri to be on site early in the morning tomorrow to check the problem.', '', NULL),
(3031, 511, 'SN', 0, '2010-05-18 09:48:30', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from yusuf. he already call user and they informed that no problem occur. He ask me to reconfirmed the problem with En Ridzuan."', '', ' ', '', NULL),
(3032, 511, 'SN', 0, '2010-05-18 09:44:18', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Azzeri. On the way to the office to sent back faulty PC taken from ATLK and PPIN. Will informed him the problem when he arrived at office."', '', ' ', '', NULL),
(3033, 511, 'SN', 0, '2010-05-18 09:39:46', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Yusuf. On the way to Alor setar because Siva Lorry will sent E2000 original unit to site today. He did not get any report from user regarding this problem. Yusuf ask to ask azzeri to see the problem."', '', ' ', '', NULL),
(3034, 511, 'SN', 0, '2010-05-18 09:36:27', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call En Ridzuan mobile since call general line keep busy. He inform that problem happened every morning."', '', ' ', '', NULL),
(3035, 510, 'SN', 0, '2010-05-17 14:44:40', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call En Ramli. Informed him like wat faizal said. He provide pasport no:\n64 pages that out empty : 20499121\n32 pages that printed 64 pages application : 20900504\n64 pages cetak semula : 20499122\n\n*Since this log is juat a guidance, log close."', '', ' ', '', NULL),
(3036, 510, 'SN', 0, '2010-05-17 14:35:41', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Informed the problem to faizal. He said that this is the system problem. He will check but need the passport number. "', '', ' ', '', NULL),
(3037, 508, 'SN', 0, '2010-05-18 12:09:23', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received SMS from Ashok. Problem already settle."', '', ' ', '', NULL),
(3038, 512, 'SN', 0, '2010-05-18 12:03:47', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call general line and status inform to Pn Zubaidah - noted engineer on site."', '', ' ', '', NULL),
(3039, 512, 'SN', 0, '2010-05-18 11:47:05', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"As this site fall under Rosdi maintenance, Nik call Rosdi and inform the status. Rosdi will on site from Subang to Port Klang."', '', ' ', '', NULL),
(3040, 512, 'SN', 0, '2010-05-18 11:45:33', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Zaki - symptom cause book printed in order but fail to move out normally from PO unit. If he try to restart E2000, error REMOVE THE SHEET IN THE PRINTER. The cause of error already known, its due to S14 sensor. But did advice Zaki to running E2000 in maintenance mode first. Will call back."', '', ' ', '', NULL),
(3041, 507, 'SN', 0, '2010-05-17 10:13:10', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Din TARGET - assign on the task and explain on status that Yusuf found out. Noted."', '', ' ', '', NULL),
(3042, 507, 'SN', 0, '2010-05-17 10:10:28', 14, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Status informed by Yusuf verbally. He suggest to replace RTE as RFID not found, but if Din can make it to look on site - maybe Din can try to replace unprotected file first."', '', ' ', '', NULL),
(3043, 510, 'SN', 0, '2010-05-17 14:26:25', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from en ramli informed that one application for 64 pages print out empty but after that the data printed out in 32 pages passport with the passport number print out same with the 64 pages passport that out empty. They already cetak semula. He just call to make sure that for 32 pages passport need to daftar rosak as wat cause. I will check with faizal first and will call back user later."', '', ' ', '', NULL),
(3044, 506, 'SN', 0, '2010-05-18 11:00:18', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Zul back to office. He informed that problem already reoslved since yesterday. Today he just monitoring. Log can be close."', '', ' ', '', NULL),
(3045, 507, 'SN', 0, '2010-05-18 11:09:50', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user confirm status ok. Log allow to close."', '', ' ', '', NULL),
