(3074, 500, 'SN', 0, '2010-05-14 09:31:21', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Problem happened where PC keep auto restart and blue screen. Ask user to OFF PLug at RTE8000 and restart PC QA. After PC ready and enter Jim, ask user to ON RTE8000. Will call back later."', '', ' ', '', NULL),
(3075, 499, 'SN', 0, '2010-05-14 11:03:28', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from Dayang. She informed that now printer run ok in maintenace mode. So they will use it."', '', ' ', '', NULL),
