(3078, 499, 'SN', 0, '2010-05-14 09:55:12', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call Arham. He said that his flight to QLIM for PM will be on tuesday evening. Ask to assign him alone to be on site morning. Nizam will standby at QMIR. Arham ok."', '', ' ', '', NULL),
(3079, 499, 'SN', 0, '2010-05-14 08:51:59', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from en Ariffin. He informed that today problem continue. So need further action. En Arifin pas phone to dayang. Dayang try to enter maintenance mode but failed to ready. Error keep repeating. Since we have meeting at a Famosa for this weekend, ask that if we can go on site nextweek on tuesday since PM team will do PM at that site nextweek. They pas to PIT Rozaimah and she agree."', '', ' ', '', NULL),
(3080, 499, 'SN', 0, '2010-05-13 16:23:42', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Spoke with en Arifin. He ask to call tomorrow since they already OFF everything. They facing electricity problem."', '', ' ', '', NULL),
(3081, 499, 'SN', 0, '2010-05-13 16:20:30', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Spoke with dayang. Check supporting tube spindal still ok."', '', ' ', '', NULL),
