(3083, 498, 'SN', 0, '2010-05-14 09:31:38', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user spoke with Sulastri. She informed that before this she use jarfalla at PC QA together with RTE8000. But now PC Jarfalla repaired by IRIS becuase during ICAO installation, engineer swap the PC for jarfalla with PC QA. And PC IRIS that install jarfalla faulty. Just finish repair by IRIS. So user ask how to install back the jarfalla. guide user and now problem resolved. Jarfalla can be use as usual. But user facing another problem. Please refer to log 1005-42(L)."', '', ' ', '', NULL),
(3084, 498, 'SN', 0, '2010-05-14 09:24:35', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from ADUKOM. Informed that user report the same problem."', '', ' ', '', NULL),
