(3087, 503, 'SN', 0, '2010-05-17 11:43:14', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received SMS from Azzeri. He adjust the book gate at feeder 2 and use as a feeder. For feeder1 that faulty, he put back the faulty book sensor."', '', ' ', '', NULL),
(3088, 503, 'SN', 0, '2010-05-17 10:14:28', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Azzeri call. Suzie pickup. Informed that problem resolved."', '', ' ', '', NULL),
