(3090, 503, 'SN', 0, '2010-05-15 11:25:23', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Informed the problem to Azzeri. He will be back to northern region on monday morning. So assign him to drop by at site to resolve dthe problem. He discuss with Yusuf because they are both northern region engineers. As per agree Azzeri will be on site on monday morning."', '', ' ', '', NULL),
(3091, 503, 'SN', 0, '2010-05-14 13:24:00', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received call from PI Azlin. After change Feeder, book insert 2 in CCD. Maybe the adjustment of book gate at feeder 2 is not ok. Ask to sned engineer on monday since now we at melaka for ICAO meeting. User agree."', '1', ' ', NULL, NULL),
(3092, 503, 'SN', 0, '2010-05-14 14:50:41', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', 'PI Azlin called. \nFound book sensor fall down from it position. She try to put it back but he dont know how. As per informed by Azhar and Zul, they already adjust feeder 2 for 48pages. Ask user to swap feeder. Will call back later.', '1', ' ', NULL, NULL),
(3334, 545, 'SN', 0, '2010-05-31 08:11:09', 27, NULL, NULL, NULL, NULL, NULL, '', 'Call user. Spoke with Pn Salina.\nIO Abu restart printer, ok. Problem resolved. Log allow to close. ', '1', NULL, NULL, NULL),
(3093, 502, 'SN', 0, '2010-05-17 11:24:46', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Call user. Spoke with En Khalifah. He informed that today he try to clean all unit again, and until now, no problem anymore. But he still ask engineer to come for service. But not today. Will informed regional engineer to be on site when free. For now, en khalifah allow to close log."', '', ' ', '', NULL),
