(3199, 416, 'CM', 0, '2010-04-30 17:39:31', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-22 09:30:00', '2010-04-22 17:00:00', '', '"Received CM report from Rosdi.\nAction taken:\n1. Swapped RTE8000.\n2. Loan unit S/N:5RL13942.\n3. Original unit S/N: 5RL13937.\n4. Test QA success.\n5. Monitor production."', '', ' ', '', NULL),
(3200, 419, 'SN', 0, '2010-04-30 17:36:52', 27, '0000-00-00 00:00:00', '', NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '"Received CM report from Azlan.\nAction taken:\n1. Adjust CCD leg only 2 screw not 3 screw.\n2. Place piece of passport paper at top pf PI unit.\n3. Run test. Feed test, production.\nBook manage to print success."', '', ' ', '', NULL),
(3201, 404, 'CM', 0, '2010-04-30 17:34:38', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-17 10:00:00', '2010-04-17 14:00:00', '', '"Received CM report from Arham.\nAction taken:\n1. Clean thermal head, platen roller, all rollers (cleaning) and fans.\n2. Change film with new.\n3. Test print.\n4. Monitor productions.\nProblem resolved. Production continue as usual."', '', ' ', '', NULL),
(3202, 425, 'CM', 0, '2010-04-30 17:32:14', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-22 14:30:00', '2010-04-23 11:00:00', '', '"Received CM report from Zul. Dislcation and skew.\nAction taken:\n1. Clean at platen roller area.\n2. take out SP1 and clean the area.\n3. Adjust timing belt from 595 Hz to 480 Hz.\n4. Monitor production.\n5. Adjust slide bar.\nPrinting success. Production continue."', '', ' ', '', NULL),
(3203, 406, 'CM', 0, '2010-04-30 17:26:41', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-18 10:00:00', '2010-04-18 12:45:00', '', '"Received CM report from Arham\nAction taken:\n1. Try to ghost original HDD but fail due to blue screen.\n2. Change old HDD with new.\n3. Ghost - success.\n4. Set all settings.\n5. Cannot do production (offline).\nImbasan PC runs normally as before. Problem solved."', '', 'Continue monitor on 19/04/10.', '', NULL),
(3204, 448, 'CM', 0, '2010-04-30 17:21:23', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-29 08:45:00', '2010-04-29 12:30:00', '', '"Received CM report from Arham.\nAction taken:\n1. Cannot repair the PC because it was under other vendor responsible. \n2. Temporary solutaion:\n - Attach jarfalla at PC QA.\n - PC QA will b used for QA process and Cetakan Muka surat pemerhatian.\n - Ser settings in txdvr22.tmt.\n - Keyboard and barcode scanner was replaced with PC QA keyboard.\nJarfalla process can be done. Problem solved temporarily."', '', 'Already inform BTMR about the problem and told them to escalate it to responsible vendor.', '', NULL),
(3205, 437, 'CM', 0, '2010-04-30 17:15:05', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-28 08:20:00', '2010-04-28 15:50:00', '', '"Received CM report from isyraf.\nAction taken:\n1. Check the timing belt 2 and 3 at film unit.\n2. Change new platen roller. 08GA45.\n3. Configure back the timing belt tension from 560 to 410 Hz for both belt 2 and 3.\nPrinter in good condition. No more dislocation problem happen."', '', ' ', '', NULL),
(3206, 412, 'CM', 0, '2010-04-30 17:10:32', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-19 16:30:00', '2010-04-19 17:30:00', '', '', '', ' ', '', NULL),
(3207, 445, 'CM', 0, '2010-04-30 17:06:24', 29, '2010-04-27 00:00:00', '01529', '55561', '2010-04-28 08:00:00', '2010-04-28 09:15:00', 'Continues CM from the day before (27/04)', '1. Change parameter settings since new thermal head replaced. (ID100, 101, 102.106).\r\n', NULL, ' ', 'Test print done. Production continue as usual, even better than yesterday.', NULL),
(3208, 445, 'CM', 0, '2010-04-30 17:01:38', 29, '2010-04-27 00:00:00', '01528', '55561', '2010-04-27 16:00:00', '2010-04-27 17:30:00', 'SINGLE WHITE LINE', '1. General cleaning (All Rollers).\r\n2. Thermal head cleaning.\r\n3. Line still exists. \r\n', NULL, ' ', 'Printing quality restored to normal. Printing continues as usual.', NULL),
(3209, 444, 'CM', 0, '2010-04-30 16:56:36', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-28 09:00:00', '2010-04-28 12:45:00', '', '"Received CM report from Maria.\nAction taken:\n1. Replace a new hard disk (western digital, 80 GB. S/N : WMAM9ZF82791) that had been cloned with PC imbasab 03 WPIN.\nOld HDD (Western digital, 80GB S/N: WMAJ96305758).\nImbasan process can be proceed as usual."', '', ' ', '', NULL),
(3210, 447, 'CM', 0, '2010-04-30 16:53:27', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-28 12:00:00', '2010-04-28 13:30:00', '', '"Received CM report from Nizam. \nAction taken:\n1. Check all connection.\n2. Bypass HDD unable to loab BIOS.\n3. Call IBM to confirm the issue.\n4. Take back the unit."', '', 'Will sent loan unit.', '', NULL),
(3211, 452, 'CM', 0, '2010-04-30 16:48:01', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-29 12:00:00', '2010-04-29 13:00:00', '', '"Received CM report from Nizam. \nAction taken:\n1. Swap with spare monitor.\n2. Take back faulty monitor.\nPC running as usual."', '', ' ', '', NULL),
(3212, 443, 'CM', 0, '2010-04-30 16:43:40', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-28 11:00:00', '2010-04-28 16:30:00', '', '"Received CM report from Faizal. Spooler got problem with network and closed while printing.\nAction taken:\n1. Change workstation loan unit.\n2. Change network cable.\n3. Swap network port.\ntaken back : Lenovo thinkcentre L3A8736.\nLoan Unit : Lenovo Thinkcentre L3A8813.\nPrinting success without network problem. "', '', 'Will repair and sent during next PM', '', NULL),
(3213, 442, 'CM', 0, '2010-04-30 16:38:26', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-28 11:00:00', '2010-04-28 16:30:00', '', '"Received CM report from Faizal. Spooler T1 got double printing and PC got OS problem.\nAction taken:\n1. Hardisk image ghost.\n2. Setup back ICAO settings.\nMonitoring production No double printing occur anymore."', '', 'Will follow up with GET Egypt', '', NULL),
(3214, 439, 'CM', 0, '2010-04-30 16:35:10', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-27 15:30:00', '2010-04-27 18:00:00', '', '"Received CM report from Ashok. \nAction taken:\n1. Change heater lmap.\n2. Test print.\n3. Monitor production.\nAlso change platen roller and heater cleaning roller since last PM engineer not change it.\nThere is no error on printer after change parts. Production continue as usual"', '', ' ', '', NULL),
(3215, 441, 'CM', 0, '2010-04-30 16:32:24', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-27 11:30:00', '2010-04-27 16:30:00', '', '"Received CM report from Rosdi.\nAction taken:\n1. Changed SCSI card slot.\n2. Restarted PC, ok."', '', 'Software engineer will come back to check the PC and troubleshoot the problem', '', NULL),
(3216, 305, 'CM', 0, '2010-04-30 16:28:59', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-29 09:30:00', '2010-04-29 12:00:00', '', '"Received CM report Faizal. \nAction taken:\n1. Repair windows.\n2. Ghost with backup image.\nSuccess QA"', '', 'Will replace back the iriginal RTE8000.', '', NULL),
(3217, 428, 'CM', 0, '2010-04-30 16:24:13', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-24 09:00:00', '2010-04-24 14:00:00', '', '"Received CM report from Azhar.\nAction taken:\n1. PI unit inspected.\n2. Replaced S12 sensor. Before : 1.75V. After : 0.13V.\n3. Added grease at DC5, DC6 and DC7.\n4. Readjusted belt 2 (650 -> 460)\n5. Clean all dusty part in PI unit.\n6. Test feed using feed test.\n7. Monitor production.\nProduction as usual."', '', ' ', '', NULL),
(3218, 385, 'CM', 0, '2010-04-30 16:21:03', 27, '0000-00-00 00:00:00', '', NULL, '2010-04-12 14:45:00', '2010-04-12 17:00:00', '', '"Received CM report from Azhar. Sensor for book detector found broken.\nAction taken:\n1. The broken sensor cannot be installed again after PF opened.\n2. Readjust other feeder (S/N: 04030083) to 48 pages.\n3. Feed test.\n4. Monitor production.\nFeed test success. Production continue as usual."', '', ' ', '', NULL),
(3219, 459, 'CM', 0, '2010-05-04 16:16:48', 27, '0000-00-00 00:00:00', '', NULL, '2010-05-03 14:30:00', '2010-05-03 16:45:00', '', '"Received CM report from naufal.\nAction taken:\n1. Cover lock assembly tighten.\n2. Test print performed.\n3. Production monitored.\nPrinter in good condition."', '', ' ', '', NULL);
