(3832, 642, 'SN', 0, '2010-06-17 09:41:42', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call user spoke with Arifin. He explained that in one process, there are three passport printed. However 2 passport printed success. The third passport always stuck inside TOPPAN. Appear error message "Imej Tidak Dijumpai". Informed user that is system problem, need to refer to HTP. ', '1', 'I will call ADUKOM to esc this log to HTP', NULL, NULL),
