(3834, 619, 'SN', 0, '2010-06-17 12:48:45', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call user spoke with PIT Mastura. She confirmed problem resolved and allow to close log.', '1', NULL, NULL, NULL),
(3835, 615, 'CM', 0, '2010-06-17 12:46:46', 23, '2010-06-14 00:00:00', '00998', NULL, '2010-06-14 15:00:00', '2010-06-15 11:20:00', 'Passports were printed without "Moon" and "Star"\r\n\r\n** The problem caused by wrongly point for DEFAULT GATEWAY as in attachment :\r\n   DEFAULT GATEWAY = 172.24.121.101', '1. Copy JIM folder, GET folder and Startup from present hard disk (Western Digital - S/N : WMAM9ZF82573)\r\n2. Changed a new hard disk (Western Digital - S/N : WMAM9ZF82098)\r\n3. Set up : \r\n   a) PCID = 023\r\n   b) IP ADDRESS = 172.24.121.203\r\n   c) DEFAULT GATEWAY = 172.24.121.254\r\n   d) SERVER DNS = 172.24.121.101\r\n   e) database\r\n3. Paste JIM folder, GET folder and Startup file into a new hard disk.', '3', NULL, 'The problem was solved and all passports were printed with "Moon" and "Star".', '2010-06-17 00:00:00'),
(3836, 645, 'SN', 0, '2010-06-17 12:45:11', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call Sufian to update status log 1006-73. Sufian informed that user reported to him there is problem with PC Jarfalla. PCI card loose and need to install back. Sufian will try ask for help from BTMR at Lawas to install back the PCI card because he cannot attend this site by today.', '1', NULL, NULL, NULL),
(3837, 645, 'SN', 0, '2010-06-17 12:48:53', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call user spoke with PIT Mastura.She reported that there is problem with Jarfalla. Appear message "Gagal mengesan pencetak". When she checked the connection between Jarfalla and PC, she found out the cable that connect to PCI card is loose. She unplugged the cable but cannot plug back the cable because the PCI card has fall down. Need to install back the PCI card into the slot.', '1', NULL, NULL, NULL),
(3838, 645, 'SN', 0, '2010-06-17 13:18:59', 34, NULL, NULL, NULL, NULL, NULL, '', 'Received call from Sufian. He informed that BTMR Nizam will go to site this afternoon and install back the PCI card.', '1', NULL, NULL, NULL),
(3839, 643, 'SN', 0, '2010-06-17 14:30:14', 34, NULL, NULL, NULL, NULL, NULL, '', 'Received call from user, Jefri. He reported problem with PC QA, refer log 1006-100. I asked him the status of TOPPAN1. He confirmed printing success and allow to close log.', '1', NULL, NULL, NULL),
(3840, 643, 'SN', 0, '2010-06-17 15:27:33', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call ADUKOM spoke with Rosmaiza. Explained to her that problem icon drive R & M missing usually happen at PC Imbasan and is not under TARGET responsibility. I informed her that I was just called user and user confirmed for now that problem resolved and happen intermittent. Informed Rosmaiza to esc this report to other vendor if user report this problem again. She agree to close log.', '1', NULL, NULL, NULL),
(3841, 644, 'SN', 0, '2010-06-17 14:30:01', 34, NULL, NULL, NULL, NULL, NULL, '', 'Receive call from user to report problem with PC QA, refer log 1006-100. Asked user the status of PC Imbasan. User confirmed problem resolved after he do SELENGGARA. User allow to close log.', '1', NULL, NULL, NULL),
(3842, 644, 'SN', 0, '2010-06-17 15:27:33', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call ADUKOM spoke with Rosmaiza to close log.', '1', NULL, NULL, NULL),
(3843, 645, 'SN', 0, '2010-06-17 18:11:47', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call PIT Mastura to update status but she did not pickup.', '1', NULL, NULL, NULL),
(3844, 645, 'SN', 0, '2010-06-17 18:13:14', 34, NULL, NULL, NULL, NULL, NULL, '', 'Received call from PIT Mastura. She informed that BTMR Nizam has install back the PCI card and Jarfalla is functioning without problem. However, the installation of PCI card is only for temporary  because right now BTMR Nizam used polystyrene to hold the PCI card from fall down. User asked TARGET to find the permanent solution for this problem. I told user that I will discuss this matter with Sufian and update her later.', '1', NULL, NULL, NULL),
(3845, 645, 'SN', 0, '2010-06-17 18:17:04', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call Sufian, he informed that BTMR Nizam had already called him and explained the situation at Lawas. Sufian reported that he need something more solid like metal to hold the PCI card. Originally the PCI card comes with a metal part that can be screwed to the CPU casing so that the PCI card will not easily detach from its slot. However, engineer have to remove the metal part because the PCI card cannot fit in the small CPU casing. Usually Sufian will modified the metal part and attached it back to PCI card and CPU casing so that the attachment will be more secure. Sufian asked me to look for any extra ''metal part'' that is not use at wokshop, he will collect it when he attend TRM at the end of this month.', '1', 'I will asked Maria if there is any extra ''metal part'' for PCI card at workshop', NULL, NULL),
(3846, 645, 'SN', 0, '2010-06-17 18:25:42', 34, NULL, NULL, NULL, NULL, NULL, '', 'Asked Maria if there is any ''metal part'' for PCI card at workshop. She found 2 and gave it to me.', '4', NULL, NULL, NULL),
(3847, 646, 'SN', 0, '2010-06-17 22:39:53', 34, NULL, NULL, NULL, NULL, NULL, '', 'Received call from Jefri. He reported error message "inn QA reader : Camera driver return an error code 19" appear after first scan. User asked me to call back because he is not at Bilik Proses right now.', '1', NULL, NULL, NULL),
(3848, 646, 'SN', 0, '2010-06-17 14:10:38', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call user spoke with Jefri. Guide user to do standalone to check the RTE8000 status. After windows for eMRTD_QA_reader appear, I asked user to click OK for every popup. But user reported appear error message "inn QA reader : Camera driver return an error code 20". I guide user to check whether icon RTE8000 and unprotected file exist at My Computer. User informed icon RTE8000 exist at My Computer but there is no icon unprotected file. I asked permission from user to hold the call for a few minutes, to refer this problem to Maria. Maria told me to restart PC and OFF RTE8000. ON back RTE8000 before user key in login ID and password, then try again standalone and check icon RTE8000 and unprotected file at My Computer. I guide user according to guidance from Maria. After user do standalone, he informed that the passport holder data is displayed. This confirmed that RTE8000 status Ok. User informed that icon RTE8000 exist at My Computer and icon unprotected file exist in drive E:\\RTE8000. I asked user to try again QA process. User informed QA process success and problem resolved. Problem resolved at 2.30pm. User allow to close log. ', '1', NULL, NULL, NULL),
(3849, 647, 'SN', 0, '2010-06-17 14:40:00', 34, NULL, NULL, NULL, NULL, NULL, '', 'Received call from Jefri. User reported process hang at encoding. Guide user to stop spooler, stop TOPPAN and restart TOPPAN. Wait until passport came out from TOPPAN and put back the passport into feeder (put passport at the bottom). Guide user to click button power off aat TOPPAN nd restart PC Spooler. Click button power on at TOPPAN during PC restart. Start again spooler. I will call back user after 10 minutes.', '1', NULL, NULL, NULL),
(3850, 647, 'SN', 0, '2010-06-17 14:55:00', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call user spoke with Jefri. He reported process hang at encoding but this time appear error message "Jaminan pasport gagal. Alihkan pasport." & error message "nppev_ICAO QA passport fail". Advised user to log this problem to ADUKOM because this problem is under other vendor responsibility. User allow to close log.', '1', NULL, NULL, NULL),
(3851, 648, 'SN', 0, '2010-06-17 15:00:15', 34, NULL, NULL, NULL, NULL, NULL, '', 'Receive call from user spoke with Jefri. He reported Monitor blue screen & error message "the system has halted. call your hardware vendor for support" happen after he click "CETAK". Guide user to force shutdown PC and turn on PC. User try again printing, appear error message "Gagal mengesan pencetak". Guide user to shut down PC, cable that connect Jarfalla to PC if it loose. Guide user to tighten back the connection, make sure PCI card is install properly at its slot. After finish checking, asked user to turn on PC and Jarfalla and try printing. I will call back user after 10 minutes.', '1', NULL, NULL, NULL),
(3852, 648, 'SN', 0, '2010-06-17 15:30:21', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call user spoke with Jefri. He reported after he click "CETAK",Monitor blue screen & error message "the system has halted. call your hardware vendor for support". Informed user that I have to refer this problem to Maria and I will call him back as soon as possible. ', '1', NULL, NULL, NULL),
