(3855, 648, 'SN', 0, '2010-06-17 16:00:16', 34, NULL, NULL, NULL, NULL, NULL, '', 'Call user spoke with Jefri. He informed that he already force shutdown, on PC and try again printing. Appear error "Gagal mengesan pencetak". Guide user  to uninstall printer and add printer. Suddenly monitor blue screen with error message "the system has halted. call your hardware vendor for support" during "New Printer Detection". I asked permission  from user to hold the call for a few minutes because I need to refer this problem to Maria. Maria asked to force shut down PC, unplug cable Jarfalla from PC. Then on PC, plug in back cable Jarfalla after 10 minutes. Guide user according to Maria guidance. I will call back user after 15 minutes.', '1', NULL, NULL, NULL),
