(4536, 743, 'CM', 0, '2010-07-20 14:05:43', 20, '2010-07-12 00:00:00', '01928', '70617', '2010-07-12 11:00:00', NULL, 'Permanent line on data page.', '1. Test print performed.\r\n2. Thermal head cleaned and test print performed.\r\n3. Replaced thermal head with the new one.', '3', NULL, 'Production run as usual.', '2010-07-20 14:07:43'),
