INSERT INTO `smart_resolutionnote` (`id`, `ticket_id`, `rsltn_type`, `rsltn_status`, `rsltn_date`, `rsltn_byuser`, `rsltn_servicedate`, `rsltn_servicennumber`, `rsltn_counter`, `rsltn_eta`, `rsltn_etd`, `rsltn_inspection`, `rsltn_actiontaken`, `rsltn_actionmethod`, `rsltn_planning`, `rsltn_remark`, `datemodified`) VALUES
(4538, 690, 'CM', 0, '2010-07-20 14:23:05', 16, '2010-06-29 00:00:00', '01400', '-', '2010-06-29 15:00:00', '2010-06-29 17:30:00', 'Permanent white line', '1. Hard cleaning at thermal head and all roller but still same.\r\n2. Try take out and install back thermal head but still same.\r\n3. Change new thermal head.\r\n4. Test print.', '3', NULL, 'Test print ok. No more white line.', '2010-07-20 14:07:05'),
(4539, 626, 'CM', 0, '2010-07-20 14:56:04', 25, '2010-06-14 00:00:00', '01805', '-', '2010-06-14 12:45:00', '2010-06-14 14:25:00', 'Ribbon empty', '1. Apply grease on thermal head.\r\n2. Tesk ok.', '3', NULL, 'There is no error on printer.', '2010-07-20 14:07:38'),
(4540, 748, 'CM', 0, '2010-07-20 15:02:29', 16, '2010-07-13 00:00:00', '01855', '-', '2010-07-13 09:00:00', '2010-07-14 12:30:00', 'Permanent White Line', '1. Hard cleaning at all roller, metal roller and thermal head.\r\n2. Try to clean many times.', '3', 'Need to change thermal head.', 'Problem still appeared.', '2010-07-20 15:07:29'),
(4541, 692, 'CM', 0, '2010-07-20 15:06:57', 16, '2010-07-06 00:00:00', '01853', '-', '2010-07-06 11:30:00', '2010-07-06 16:30:00', 'Permanent white line.', '1. Change thermal head.old S/N: 82-155-01. New S/N: 94-139-01.\r\n2. Change ID. ID100 = 1 -> 0\r\nID101 = 1 -> 4.\r\nID102 = 2 -> 0\r\nID106 = 2 -> 4\r\n3. Test print & monitor production. ', '3', NULL, 'Printer work as usual.', '2010-07-20 15:07:57'),
(4542, 681, 'CM', 0, '2010-07-20 15:17:14', 16, '2010-07-02 00:00:00', '01852', '-', '2010-07-02 09:00:00', '2010-07-02 16:00:00', '1. PC Jarfalla sometimes not detect printer.\r\n2. Barcode scanner need to push enter to process.\r\n3. ''Jura failed'' appeared.\r\n4. Printed laminate too low.\r\n5. Print wrong number for PTB without pop up.', '1. Adjust and modify holder for PCI card.\r\n2. Adjust setting for barcode scanner.\r\n3. Change jurs dongle at other USB port.\r\n4. Test and monitor production.\r\n5. Change ID8 from 10 to -10 but effect PTB so change back to 10.\r\n6. Update training file. Old :07/01/2010, 153kB. New : 24/06/2010, 160 kB.', '3', NULL, '1. PC jarfalla work as usual.\r\n2. Barcode scanner ok\r\n3. No more error ''Jura fail''.\r\n4. No more wrong number printed.', '2010-07-20 15:07:14'),
(4543, 790, 'SN', 0, '2010-07-16 15:40:47', 27, NULL, NULL, NULL, NULL, NULL, '', 'Received CM report from Din. ', '4', 'Log close since problem already resolved on the day Din on site.', 'Log close same as departure time in CM report.', NULL),
