(5264, 930, 'CM', 0, '2010-08-16 15:07:16', 20, '2010-08-15 00:00:00', '01943', '36339', '2010-08-15 09:30:00', '2010-08-15 13:00:00', '-white line(horizontal) on data page', '1)all printing rollers were cleaned.\r\n2)thermal head was then inspected,cleaned and tested. The same procedure repeated again and again until confirmed that the line on the specimen printed was permanent. \r\n3)thermal head were taken out and replaced.\r\n4)testing made,no more line, proceed with the actual production.', '3', '-the TH is still new and will be taken back to workshop for rehab.', '-The machine running as usual.', '2010-08-16 15:08:11'),
