(5266, 934, 'CM', 0, '2010-08-17 08:54:10', 20, '2010-08-16 00:00:00', '01944', '73767', '2010-08-16 09:15:00', '2010-08-16 13:15:00', '-platten screw break into two.', '1)PI and PO units were taken out, took out the platten screw,washer and collar found,and general cleaning on both units performed.\r\n2)Noticed that half of the screw was stuck inside the platten collar(with o ring) with washer, tried to disemble three of them, failed.\r\n3)Next, the O-ring were taken out and installed on the new Collar.\r\n4)New platten roller installed(current roller already exceed maximum working mileage).\r\n5)testing, and then production monitored.\r\n', '3', '-', '-printing operation continued.', '2010-08-17 09:08:38'),
